265852408_943867009882881_2150302283084683655_n.jpg?stp=dst-jpg_e35_p1080x1080&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=109&_nc_ohc=yOS1sQo93oAAX81dogt&edm=APU89FABAAAA&ccb=7-4&oh=00_AT-k6Tpfm1O0Cpp81T7nzOtDa34phUm15hX52aSCRO5bew&oe=626E6C3E&_nc_sid=86f79a': {'post_date': '2021-12-11T15:54:26.000Z', 'post_bio': 'P2 on the front row tomorrow, not bad since I prefer the battle. We‚Äôre looking strong and feeling focused ‚Äî we‚Äôve got to dig deeper than ever before. LET‚ÄôS GO ‚ÄºÔ∏è‚ÄºÔ∏è', 'post_hashtags': [], 'likes': 1929582, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/266498743_4724172774305958_8060926290948866671_n.jpg?stp=dst-jpg_e35_p1080x1080&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=106&_nc_ohc=pqTn9TR15DcAX-LqQKB&edm=APU89FABAAAA&ccb=7-4&oh=00_AT-s_bVl7A7YVlHrMKX0UckfRtcf9oduXZ_n4hEdfPaBMw&oe=626E969A&_nc_sid=86f79a': {'post_date': '2021-12-10T17:37:19.000Z', 'post_bio': 'We‚Äôve come a long way, me and @valtteribottas. Let‚Äôs do it up big for our last as teammates', 'post_hashtags': [], 'likes': 1354508, 'type': 'photo'}}, {'https://scontent-lhr8-2.cdninstagram.com/v/t51.2885-15/277038280_690547095325792_4558253113886951143_n.jpg?stp=dst-jpg_e35_p1080x1080_sh0.08&_nc_ht=scontent-lhr8-2.cdninstagram.com&_nc_cat=104&_nc_ohc=SKgJGTz2Qq4AX-j7Dic&edm=ALQROFkBAAAA&ccb=7-4&ig_cache_key=Mjc5OTY2NzEyOTgwMDMwNTQ4Ng%3D%3D.2-ccb7-4&oh=00_AT9ir1yiUfjCIkikGm6ACw2yoAs_TLcDBvIbTrF90HzB2w&oe=626F1463&_nc_sid=30a2ef': {'post_date': '2022-03-22T16:37:08.000Z', 'post_bio': 'A while back I had the opportunity to spend a whole day surfing with @dylanferrandis and @makuarothman. I take any chance I can get to be in water. I‚Äôd be in the ocean all day if I could. Surfing is the best way to unlock balance which is so important in training and in life. Thanks @MonsterEnergy for letting me remind everyone I‚Äôm not too bad on that board ü§ôüèæ üèÑüèΩ‍‚ôÇÔ∏èüåä #monsterenergy', 'post_hashtags': ['#monsterenergy'], 'likes': 909865, 