power, I‚Äôve never wanted to be anyone else. On @MasterClass, I‚Äôm going to teach you how to own your individuality and use it to your advantage in pursuing your goals. I‚Äôll also share my personal tips for facing your fears and using your struggles to make you stronger. Please join me. Link in bio.', 'post_hashtags': [], 'likes': 3528431, 'type': 'video/mp4'}}, {'https://scontent-lhr8-2.cdninstagram.com/v/t51.2885-15/262140048_1522239034825253_7281484687634831298_n.jpg?stp=c0.115.1440.1440a_dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-2.cdninstagram.com&_nc_cat=105&_nc_ohc=iq5XS-KTfWkAX-qxEEO&edm=APU89FABAAAA&ccb=7-4&oh=00_AT-FOHKQIdi9p_KjeKgNui5ex_XMv9wxxX1lVmrCbxl-bA&oe=626F03BF&_nc_sid=86f79a': {'post_date': '2021-12-01T18:54:14.000Z', 'post_bio': 'Equality for all.', 'post_hashtags': [], 'likes': 702444, 'type': 'photo'}}, {'https://scontent-lhr8-2.cdninstagram.com/v/t51.2885-15/261852714_1134707843727985_5668467589006907162_n.jpg?stp=c156.0.407.407a_dst-jpg_e35&_nc_ht=scontent-lhr8-2.cdninstagram.com&_nc_cat=101&_nc_ohc=92R834HmrB8AX_NaN0a&edm=APU89FABAAAA&ccb=7-4&oh=00_AT89zWjx4xxfVYoL0v42z9AP7uAh4R1V89K28slhIMdxDQ&oe=626A3C37&_nc_sid=86f79a': {'post_date': '2021-11-30T19:17:06.000Z', 'post_bio': 'My niece helping me get into top form for these last two races üòÇ I was bullied as a kid but martial arts really helped, it instilled in me discipline, respect and it helped me protect myself ‚Äî I‚Äôm so proud that she and her brother have started learning', 'post_hashtags': [], 'likes': 5834611, 'type': 'video/mp4'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/261643731_214613677485696_1288671536971080180_n.jpg?stp=dst-jpg_e35_p1080x1080&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=100&_nc_ohc=vSA_t4p8teMAX8_c2Qi&edm=APU89FABAAAA&ccb=7-4&oh=00_AT9lUA2Ngk3P0swenA7CsWGorC3pxp8vPibqaFP7TlUvoA&oe=626E9E9A&_nc_sid=86f79a': {'post_date': '2021-11-29T15:47:48.000Z', 'post_bio': 'I‚Äôve spent the last day trying to think of what to say, but words fail me as I try to accept the reality of Virgil‚Äôs passing.
‚Äî
Yesterday‚Äôs news left me in shock. Virgil and I were just texting a couple weeks ago about working together, collaborating and dreaming. One minute you‚Äôre here and the next you‚Äôre gone. Virgil showed us that dreams, no matter how big they are can always be turned into reality. He was a visionary, somebody that forever pushed boundaries and never let anything or anyone hold him back. He was always the kindest in the room and in his short time, was a true game-changer and inspired so many of us to see fashion in a different light. An icon and legend that will forever live on ‚Äî we will never forget what he did for Black culture. I am so entirely grateful to him for always including me, seeing me and supporting me. My thoughts and prayers are with his loving wife Shannon and his two children Lowe and Grey. There‚Äôs nothing more precious than time.', 'post_hashtags': [], 'likes': 970318, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/261169560_639789370353032_8604687357503789573_n.jpg?stp=dst-jpg_e35_p1080x1080&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=108&_nc_ohc=qrox1W-G3NgAX-BvSdV&tn=ZRY-MpqNu-mBjEbd&edm=APU89FABAAAA&ccb=7-4&oh=00_AT9GB1tFkVIMW50xZ8w2QR3irQetJDeZZ6j5RKgZtLAaVg&oe=626E17C8&_nc_sid=86f79a': {'post_date': '2021-11-28T17:53:30.000Z', 'post_bio': 'Sir Frank Williams was one of the kindest people I had the pleasure of meeting in this sport, always had time for me and always without judgment. I feel so honoured to have called him a friend. What he achieved in this sport is something truly special. Until his last days I know he remained a racer and a fighter at heart. I have utmost respect and love for this man, and his legacy will live on forever. You will be missed Frank, but I will see you on the other side. My thoughts and prayers are with the Williams family.', 'post_hashtags': [], 'likes': 1077932, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/258883614_443773017166040_78453839108