ENPCvlAUNRX3RoOrj8yuJA&oe=626A24A3&_nc_sid=86f79a': {'post_date': '2021-09-24T17:59:11.000Z', 'post_bio': 'I believe this is the first time I‚Äôve taken out a mechanic in 14 years. My heart was in my mouth, I was so worried. Thankfully he was ok, pretty courageous to stand in front of the car like that. We all make mistakes, it‚Äôs part of the journey, but it‚Äôs how we come back from them that matters most.', 'post_hashtags': [], 'likes': 6597640, 'type': 'video/mp4'}}, {'https://scontent-lhr8-2.cdninstagram.com/v/t51.2885-15/242696918_181675087430765_9200654764920424216_n.jpg?stp=c0.62.1440.1440a_dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-2.cdninstagram.com&_nc_cat=105&_nc_ohc=52ox4mKV9kYAX_9VORk&edm=APU89FABAAAA&ccb=7-4&oh=00_AT9ClmdyqRMff1QL9GJ6O7R77rk0ufQgc04VJxoB2twT7Q&oe=626E42F1&_nc_sid=86f79a': {'post_date': '2021-09-23T17:22:36.000Z', 'post_bio': 'These quieter moments before the weekend kicks off and engines start ‚Äî they never get old. Our work never stops and we‚Äôre as determined as ever.', 'post_hashtags': [], 'likes': 713787, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/242385495_662102598083970_1102600986169164701_n.jpg?stp=dst-jpg_e35_p1080x1080&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=106&_nc_ohc=mZqwj1wwaWwAX88KH2r&edm=APU89FABAAAA&ccb=7-4&oh=00_AT8sg7MvcrLGZlm_hWGvNJu0KVma5LLU5jIU2L2kdaQqtQ&oe=626F5633&_nc_sid=86f79a': {'post_date': '2021-09-22T15:34:04.000Z', 'post_bio': 'NYC ‚û°Ô∏è London ‚û°Ô∏è Sochi', 'post_hashtags': [], 'likes': 511361, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/242331432_2904322903231596_5011151758655886765_n.jpg?stp=dst-jpg_e35_p1080x1080&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=100&_nc_ohc=7VCbTmvZxbwAX-BlTUE&edm=APU89FABAAAA&ccb=7-4&oh=00_AT8nfVmDGb2pDJxWdXk0JuO8P8sHcbwT9-mmFZTcmQj9fg&oe=626E4231&_nc_sid=86f79a': {'post_date': '2021-09-21T14:11:44.000Z', 'post_bio': 'I‚Äôve been reflecting on the last week and what an honor it was to attend the Met Gala with a group of creatives with such bright futures. @kenneth.nicholson and I enjoyed the challenge of virtual collaboration. Upon landing in New York early last Monday, we had fun playing around with the various options he custom created. More to come on this talented group‚Ä¶ üé•üîú', 'post_hashtags': [], 'likes': 734433, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/241795534_1692200057642613_312200803315103098_n.jpg?stp=dst-jpg_e35_p1080x1080&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=109&_nc_ohc=KULF-NY0oYcAX-i0NaT&edm=APU89FABAAAA&ccb=7-4&oh=00_AT923gtnwQNB70pbS01dx6GO3hG83nSmrtWnsoHr1d6ZxA&oe=626E1621&_nc_sid=86f79a': {'post_date': '2021-09-14T18:04:22.000Z', 'post_bio': 'Pure magic last night. These designers ‚Äî @kenneth.nicholson, @theophilio, @jasonrembert ‚Äî deserve this moment just as much as any other designer who attends the Met Gala. The goal is, and always will be, to open doors for young Black creatives üñ§', 'post_hashtags': [], 'likes': 1178160, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/241770532_286458676260384_7416439988956846884_n.jpg?stp=dst-jpg_e35_p1080x1080&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=100&_nc_ohc=xy1XMJylMokAX-26e0P&edm=APU89FABAAAA&ccb=7-4&oh=00_AT8pOq6F1H2evqfKl06dtW4f9VD98utnzvJEh8OGsIQjGw&oe=62700256&_nc_sid=86f79a': {'post_date': '2021-09-14T03:05:38.000Z', 'post_bio': 'So incredibly honoured to have collaborated with American Designer @kenneth.nicholson on bringing this vision to life. Kenneth‚Äôs craftsmanship and point of view advances menswear in truly inspiring ways. It‚Äôs a dream.', 'post_hashtags': [], 'likes': 1295604, 'type': 'photo'}}, {'https://scontent-lhr8-2.cdninstagram.com/v/t51.2885-15/241797100_2925550334335481_859218337514163503_n.jpg?stp=dst-jpg_e35_p1080x1080&_nc_ht=scontent-lhr8-2.cdninstagram.com&_nc_cat=105&_nc_ohc=pNex4yFUxusAX9r7tKy&tn=ZRY-MpqNu-mBjEbd&edm=APU89FABAAAA&ccb=7-4&oh=00_AT-y689QnhjmenVPHe50f1lgZMdReRr4CTDNNrh6M-xgyw&oe=626ED376&_nc_sid=86f79a': {'post_date': '2021-09-13T14:45:03.000Z', 'post_bio': 'Gym buddy came out to the track yesterday @vindiesel', 'post_hashtags': [], 'likes': 1727198, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/241991038_533161004410748_3811707190775251465_n.jpg?stp=dst-jpg_e35_p1080x1080&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=108&_nc_ohc=Ri2fOyxZFUkAX_-1Tzr&edm=APU89FABAAAA&ccb=7-4&oh=00_AT9w7HpeUr-5O43eA4f5jnlQ3i4SL-7uEQ8j94CZkFSaMA&oe=626FBD82&_nc_sid=86f79a': {'post_date': '2021-09-12T18:34:20.000Z', 'post_bio': "It's days like today, I am reminded of how lucky I am. It takes a millisecond to go from racing to a very scary situation. Today someone must have been looking down, watching over me! My necks a bit sore as the adrenaline wears off - it was a bit of a hit on the head, so naturally I have one big headache but I'm doing okay! The halo stopped the crash from being a lot worse and I'm incredibly grateful to all those that work to make our cars and racing safer. TeamLH ... the support I receive from you keeps me pushing and fighting. I'm so thankful for each and everyone of you, you are truly the best. Still we rise!", 'post_hashtags': [], 'likes': 2303766, 'type': 'photo'}}, {'https://scontent-lhr8-2.cdninstagram.com/v/t51.2885-15/241525344_1453676545016798_4313424830411926329_n.jpg?stp=dst-jpg_e35_p1080x1080&_nc_ht=scontent-lhr8-2.cdninstagram.com&_nc_cat=102&_nc_ohc=2Gt7gl353cMAX9-yKUy&tn=ZRY-MpqNu-mBjEbd&edm=APU89FABAAAA&ccb=7-4&oh=00_AT8qhLxtl9VCUiCiN_qDiy7DtRRB3qDNdn1Prq2WyYetlg&oe=626F02BF&_nc_sid=86f79a': {'post_date': '2021-09-11T14:01:59.000Z', 'post_bio': 'Don‚Äôt text and drive', 'post_hashtags': [], 'likes': 525843, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/241426347_648226406156887_6050744836134173972_n.jpg?stp=dst-jpg_e35_p1080x1080&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=107&_nc_ohc=loISnwgHyKMAX84NoLy&tn=ZRY-MpqNu-mBjEbd&edm=APU89FABAAAA&ccb=7-4&oh=00_AT8bVaXqD80YimcCCdKzM0dP-Yq876GTpm91BvaInDsvSA&oe=626E7FA6&_nc_sid=86f79a': {'post_date': '2021-09-10T19:41:23.000Z', 'post_bio': 'No matter how many years go by, I‚Äôm still searching for that perfect lap. It never gets any easier. Some you win, some you lose, the love-hate relationship with that battle is something that still, to this day, keeps me coming back. Today @valtteribottas killed that lap üî• onto the next one. Leave everything behind and prep for what‚Äôs ahead.', 'post_hashtags': [], 'likes': 555665, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/241176553_4168400153208381_3410508433543550766_n.jpg?stp=c0.137.1440.1440a_dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=109&_nc_ohc=ZOlkDrzqpo4AX91npA1&edm=APU89FABAAAA&ccb=7-4&oh=00_AT_nn39Qo8nbPHGfYv0eUqfImcEnLctvkvP3Iqk-xFCxjQ&oe=626F685E&_nc_sid=86f79a': {'post_date': '2021-09-09T12:22:22.000Z', 'post_bio': 'Buon giorno Monza', 'post_hashtags': [], 'likes': 499113, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/241452169_172399725026767_419517376166377706_n.jpg?stp=dst-jpg_e35_p1080x1080&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=107&_nc_ohc=pYtYmuIrNfkAX80VEzj&tn=ZRY-MpqNu-mBjEbd&edm=APU89FABAAAA&ccb=7-4&oh=00_AT_Y2dgvz6Z6t1Ww3Yx3E90qs6sQ-Xjstm4trkStK6JU3w&oe=626E71F1&_nc_sid=86f79a': {'post_date': '2021-09-08T15:20:10.000Z', 'post_bio': 'What song we listening to?', 'post_hashtags': [], 'likes': 797230, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/241314800_1161140821039376_7346659958936944180_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=108&_nc_ohc=oOCUabmSsiEAX-ICRzv&edm=APU89FABAAAA&ccb=7-4&oh=00_AT-B4sz9L1lgwCQIVIn2wXTsK1xNJ72C3_RWKlRsqm_-vw&oe=626A88C2&_nc_sid=86f79a': {'post_date': '2021-09-07T15:33:37.000Z', 'post_bio': '@cullen_angela & I training in the ocean, perfect prep for this weekend. No time to rest!!', 'post_hashtags': [], 'likes': 2797692, 'type': 'video/mp4'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/241410547_544690230133371_2752058091973828003_n.jpg?stp=dst-jpg_e35_s1080x1080&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=103&_nc_ohc=_UxgnrytzR4AX8xLl2n&tn=ZRY-MpqNu-mBjEbd&edm=APU89FABAAAA&ccb=7-4&oh=00_AT_2bruRkOX9RpXObShwXOwRR_QraGJG18qn1SA4O03iQw&oe=62700113&_nc_sid=86f79a': {'post_date': '2021-09-07T09:53:06.000Z', 'post_bio': 'I want to take a moment to welcome @georgerussell63 to the team. I remember meeting him when he was young, dreaming of one day being a Formula 1 driver. I‚Äôd only just reached my own dream of becoming an F1 driver, so I know what this day means and how it will feel for him. He is a great example to all the kids out there that dreams do come true when you chase them wholeheartedly. Through hard work he has rightly earned his spot on our team. I look forward to seeing him grow as a driver with this great team and working with him to raise @mercedesamgf1 higher. See you next yearüôèüèæ', 'post_hashtags': [], 'likes': 1478992, 'type': 'photo'}}, {'https://scontent-lhr8-2.cdninstagram.com/v/t51.2885-15/241259424_172984024900097_4086288679581161485_n.jpg?stp=dst-jpg_e35_s1080x1080&_nc_ht=scontent-lhr8-2.cdninstagram.com&_nc_cat=105&_nc_ohc=cm86k7R71bMAX_pdGGf&edm=APU89FABAAAA&ccb=7-4&oh=00_AT9nvtTCxlviKHiFbv_6r4xp7-sfBNyigG3f04RAUooOxQ&oe=626EDC67&_nc_sid=86f79a': {'post_date': '2021-09-06T14:14:44.000Z', 'post_bio': 'I‚Äôm immensely proud to have worked alongside @valtteribottas for the last five years. Together, we‚Äôve been part of a team that has delivered four Constructors‚Äô Championships, and we‚Äôve motivated one another to keep pushing through the ups and the downs. He has been the best teammate I‚Äôve had the pleasure of working with. Your speed and resilience has been impressive but where you truly stand out to me is the human being you are. You are greater than you know and I know there‚Äôs a bright future ahead for you.

