07-29T14:57:56.000Z', 'post_bio': 'I‚Äôve been with @mercedesamgf1 for 24 years. They have supported me through thick and thin. I can remember racing in Portugal at the world karting championship with AMG on my visor when I was 15 dreaming that one day I would be racing in Formula 1 for them. I‚Äôm so proud of the growth within the brand, leading the world of luxury cars but also the fastest and most technically advanced. Coming together we push to be better in every way, most recently for more inclusion and diversity within our sport and industry. Keep watching this space because together we can achieve anything. Excited for you to see the new hybrid and electric cars to comeüíöüôèüèæ #amg #mercedes', 'post_hashtags': ['#amg', '#mercedes'], 'likes': 1080630, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/228002144_549340216199721_3044957171166124266_n.jpg?stp=dst-jpg_e15_fr_p1080x1080&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=109&_nc_ohc=vaTQKmvL7aAAX_FqWjL&edm=APU89FABAAAA&ccb=7-4&oh=00_AT9JHXEPbbd4gRJ8oDNhw2dQxAlPDlZJeXcFpKZHbHQ5qA&oe=626F74E5&_nc_sid=86f79a': {'post_date': '2021-07-29T11:22:08.000Z', 'post_bio': '8 years ago in Hungary. My first win with Mercedes. Taking this energy into the weekend', 'post_hashtags': [], 'likes': 681677, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/222067287_946594826196048_1499823139693340625_n.jpg?stp=c0.180.1440.1440a_dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=100&_nc_ohc=pHdMmi_YxvYAX9fYGT1&edm=APU89FABAAAA&ccb=7-4&oh=00_AT8uTehMBhKIxk8igKFfUJmlCZMctjsTQ7eCvhGfOSKF7w&oe=626EB675&_nc_sid=86f79a': {'post_date': '2021-07-24T19:02:00.000Z', 'post_bio': 'Roscoe and I wanted to send everyone positive energy and love for the weekend. Stay safeüò∑üôèüèæ', 'post_hashtags': [], 'likes': 818447, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/223297190_348515746985682_7717191511347795971_n.jpg?stp=dst-jp