action! So excited for this journey. https://www.hamiltoncommission.org/the-report', 'post_hashtags': [], 'likes': 393713, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/211210621_1180995152413653_6556074213796612010_n.jpg?stp=dst-jpg_e15_fr_p1080x1080&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=109&_nc_ohc=Rf2GG-AI5wsAX_bkBle&edm=APU89FABAAAA&ccb=7-4&oh=00_AT8sPU_WWFIg1J9gX_Di74DZE2sDZ_rHJpO4llId1LGoKw&oe=626F90C6&_nc_sid=86f79a': {'post_date': '2021-07-13T17:31:19.000Z', 'post_bio': 'I‚Äôm so proud to announce that today The Hamilton Commission is publishing its report into understanding how to improve diversity within UK Motorsport. From the thousands of jobs in Formula 1, only 1% of employees are from Black backgrounds. The Hamilton Commission aims to change that. We interviewed 700+ Black young people and 80+ stakeholders across motorsport to help inform our research ‚Äì click the link in my bio to find out what we discovered.', 'post_hashtags': [], 'likes': 262346, 'type': 'photo'}}, {'https://scontent-lhr8-2.cdninstagram.com/v/t51.2885-15/218278407_274075004472088_2639107569404476075_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-2.cdninstagram.com&_nc_cat=104&_nc_ohc=RKsZwXU4EvkAX8J07QK&edm=APU89FABAAAA&ccb=7-4&oh=00_AT-Ij6cauX-IEA6FnnLS8AVQw18wQ13ZhQnq_C6SVPAA4g&oe=626E6442&_nc_sid=86f79a': {'post_date': '2021-07-12T13:52:32.000Z', 'post_bio': 'So much was running through my mind as a watched the final moments of the match last night. On one hand I was so proud of how far we have come ...to be in the final and with such a diverse team is a huge achievement we should all be proud of but as the players stepped up to take the penalties I was worried. The pressure to deliver is felt by every sportsperson but when you are a minority representing your country this is a layered experience. Success would feel like a double victory, but a miss feels like a two-fold failure when its compounded with racist abuse.
I so badly wanted that win like all of you but for me it was for much more than winning the euros, it was a much bigger picture. However, the disgusting behaviour by the few, shows how much work that still needs to be done. I hope that this opens a conversation around acceptance. We must work towards a society that doesn‚Äôt require Black players to prove their value or place in society only through victory. Ultimately everyone on the England team should be so proud of their achievement and how they represented us.', 'post_hashtags': [], 'likes': 1197261, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/213229479_373230054185672_5545853057427633190_n.jpg?stp=c0.144.1152.1152a_dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=108&_nc_ohc=tzlCAlXPayIAX9yWlhp&tn=ZRY-MpqNu-mBjEbd&edm=APU89FABAAAA&ccb=7-4&oh=00_AT936L5aNZ6Ne9sBefiOeGHvE-BjlZ38lU0-lT9DbxbY3w&oe=626E57BE&_nc_sid=86f79a': {'post_date': '2021-07-10T11:25:45.000Z', 'post_bio': 'Wishing everybody a happy weekend from @roscoelovescoco and I üñ§', 'post_hashtags': [], 'likes': 678794, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/200866199_499242728049082_922312764206117694_n.jpg?stp=dst-jpg_e15_fr_p1080x1080&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=110&_nc_ohc=GF8q-naMd-QAX_rnupq&edm=APU89FABAAAA&ccb=7-4&oh=00_AT91VFC-E2KzY0B7NqQ7KGfQLNRBUi0TlfpyY4CoeMnwog&oe=626FA745&_nc_sid=86f79a': {'post_date': '2021-07-08T16:44:07.000Z', 'post_bio': 'A city that inspires. Where should I visit while I am here?', 'post_hashtags': [], 'likes': 970964, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/210824602_845149793081119_7114430589432034586_n.jpg?stp=dst-jpg_e35_s1080x1080&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=107&_nc_ohc=xFE8_CmsBo8AX_7nQ03&edm=APU89FABAAAA&ccb=7-4&oh=00_AT81Kla4648aQfgFBuO3x3tXSgldWq2s3_6T2aweY-sc0Q&oe=626F20A3&_nc_sid=86f79a': {'post_date': '2021-07-07T12:29:02.000Z', 'post_bi