e have diversity and inclusion in our sport but I'm excited to be finally be able to share with you some of the things I've been working on to help make this change. I'll soon be releasing the findings of the Hamilton Commission that I launched last year to understand why there was so little black representation in motorsport. I hope we can work together with the results to make this sport more accessible and diverse and ultimately more reflective of the outside world.", 'post_hashtags': [], 'likes': 563853, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/208988050_175025454589318_8780204878666098542_n.jpg?stp=dst-jpg_e15_fr_p1080x1080&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=110&_nc_ohc=isDBuNHkv54AX-5k8Ko&tn=ZRY-MpqNu-mBjEbd&edm=ALQROFkBAAAA&ccb=7-4&ig_cache_key=MjYwNTUxMjAxNzQwMDAzNzAxNQ%3D%3D.2-ccb7-4&oh=00_AT94KmzYusaknbC1FBwmc-BkGgm_P21Tc932jcsY-0MUXQ&oe=626E1490&_nc_sid=30a2ef': {'post_date': '2021-06-27T19:14:18.000Z', 'post_bio': 'I gave it everything out there today. Even in the build up to the weekend, putting in the extra time to find performance but it just wasn‚Äôt possible today. They‚Äôve made a big step and done a great job. Congrats to @maxverstappen1, I hope we can have a closer battle soon if we find some performance to match you guys. We have to keep pushing to be better. Onto the next one üëäüèæ', 'post_hashtags': [], 'likes': 636828, 'type': 'photo'}}, {'https://scontent-lhr8-2.cdninstagram.com/v/t51.2885-15/208959330_268278725070410_8192247988811424352_n.jpg?stp=dst-jpg_e15_fr_p1080x1080&_nc_ht=scontent-lhr8-2.cdninstagram.com&_nc_cat=102&_nc_ohc=PZhKHPkU03UAX-Am9_u&edm=ALQROFkBAAAA&ccb=7-4&ig_cache_key=MjYwNDA4NTUyNjIyMTA2NzAxNA%3D%3D.2-ccb7-4&oh=00_AT8LXBHIE08SX2lzussXf0MGWjoflNd0s9ffS9GsD7sMRQ&oe=626E5F92&_nc_sid=30a2ef': {'post_date': '2021-06-25T20:00:07.000Z', 'post_bio': 'üíú üíú üíú', 'post_hashtags': [], 'likes': 443665, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/202160271_582976496395199_3295924765216938167_n.jpg?stp=dst-jpg_e15_fr_p1080x1080&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=111&_nc_ohc=aCWbUyXKyX0AX_uFEpj&edm=APU89FABAAAA&ccb=7-4&oh=00_AT8BZkndme5H06HTpilw53ZY2i5H0vJW3QlafJj02rW76Q&oe=62700927&_nc_sid=86f79a': {'post_date': '2021-06-17T16:07:02.000Z', 'post_bio': 'Bienvenue üá´üá∑', 'post_hashtags': [], 'likes': 856268, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/202030206_4365829786782295_863141753093122062_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=107&_nc_ohc=lCGfQAXb4-cAX-f7c1v&tn=ZRY-MpqNu-mBjEbd&edm=APU89FABAAAA&ccb=7-4&oh=00_AT9UUJuh0aYQ1CrXoknkVDC4nDbo_grUUBc1jnQ4aEtkyQ&oe=626EB06F&_nc_sid=86f79a': {'post_date': '2021-06-17T12:16:18.000Z', 'post_bio': 'Hey world!! Sending everybody love and positivityüôèüèæ', 'post_hashtags': [], 'likes': 466734, 'type': 'photo'}}, {'https://scontent-lhr8-2.cdninstagram.com/v/t51.2885-15/198082662_1244969479250716_2943056826145241192_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-2.cdninstagram.com&_nc_cat=104&_nc_ohc=T-tXpkQjU3wAX8sCnls&edm=APU89FABAAAA&ccb=7-4&oh=00_AT-TeIgZKBAInrH1KA4UztQ_rkyy-X9tnf5y26Kpzrq_4w&oe=626FE360&_nc_sid=86f79a': {'post_date': '2021-06-08T17:55:10.000Z', 'post_bio': 'When most kids had cute teddies or fluffy blankets, I had this guy ‚ù§Ô∏èüòÇ thanks Mum for keeping him safe!', 'post_hashtags': [], 'likes': 656016, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/198768631_229927775304430_6053232521611591294_n.jpg?stp=c0.180.1440.1440a_dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=110&_nc_ohc=WXuCfoTSzhoAX92c64r&edm=APU89FABAAAA&ccb=7-4&oh=00_AT9sANXUQYbPqU6Jw9y01qCklN72MBsanIfr6haHpxw_uA&oe=626F731D&_nc_sid=86f79a': {'post_date': '2021-06-07T17:06:45.000Z', 'post_bio': 'There is nothing we can do about the past but learn. We rise each day to a new opportunity and chance to be better than the day before. I for one am driven, more focused than ever and looking forward! We win and we lose together, we can do anything we put our mind to!', 'post_hashtags': [], 'likes': 662901, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/198572231_532238244465799_2699269205536368389_n.jpg?stp=c141.0.1158.1158a_dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=107&_nc_ohc=Nqs1RpolfUwAX_5ryJn&edm=APU89FABAAAA&ccb=7-4&oh=00_AT8fgtTxJkq3hM58vjDlFPN5NcMTKj73x-RmOFEce0XU5Q&oe=626F464E&_nc_sid=86f79a': {'post_date': '2021-06-06T15:36:03.000Z', 'post_bio': 'Today was a humbling experience. We worked so hard to put ourselves back in the top 10 today after a rocky week here in Baku. We gave it our all today and a small error caused the brakes to switch off. Sorry to the men and women in our team, we‚Äôll come back stronger for the next race üôèüèæ', 'post_hashtags': [], 'likes': 1153212, 'type': 'photo'}}, {'https://scontent-lhr8-2.cdninstagram.com/v/t51.2885-15/197090893_190398959661521_7763382581516260503_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-2.cdninstagram.com&_nc_cat=105&_nc_ohc=u3N6h3NsHgIAX_rtt_j&edm=APU89FABAAAA&ccb=7-4&oh=00_AT8OPsslyr_QL6KTDEuchkUgc0XERkKTS3IDJw0H_2nz4A&oe=626ED4CD&_nc_sid=86f79a': {'post_date': '2021-06-06T11:09:54.000Z', 'post_bio': 'I carry a heavy heart into the race after the loss of a close friend, Mansour Ojjeh. He was a big brother to me. He had the biggest heart and always carried the biggest smile. He fought for so many years with such courage and the heart of a lion. I am so grateful to have known such a man. I will miss his jokes, he was the best at telling them, and his big hugs. This man loved unconditionally. Rest in peace brother, love you alwaysüñ§üôèüèæ', 'post_hashtags': [], 'likes': 461057, 'type': 'photo'}}, {'https://scontent-lhr8-2.cdninstagram.com/v/t51.2885-15/196296838_552127145786162_1382693982263394235_n.jpg?stp=dst-jpg_e35_p1080x1080&_nc_ht=scontent-lhr8-2.cdninstagram.com&_nc_cat=102&_nc_ohc=YcQHjOlNHS4AX_oMhx_&edm=APU89FABAAAA&ccb=7-4&oh=00_AT_rXNIIk118cZ1zIluHcu6P9CyXILKawUFNVwL2I-OgIA&oe=626E83B8&_nc_sid=86f79a': {'post_date': '2021-06-04T13:59:53.000Z', 'post_bio': 'Tough start to the weekend. Lots of work to do tonight but we‚Äôll keep pushing üí™üèæ #TeamLH', 'post_hashtags': ['#TeamLH'], 'likes': 522381, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/195004108_380231316761600_3671997750366645207_n.jpg?stp=c0.90.720.720a_dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=108&_nc_ohc=MrAUtQ_Jm5wAX_TqBGw&edm=APU89FABAAAA&ccb=7-4&oh=00_AT_k8INfuPcwCTEnhQfPnu6henY3H7K-cjdSEByUrTOTbQ&oe=626A7328&_nc_sid=86f79a': {'post_date': '2021-06-03T10:22:33.000Z', 'post_bio': 'What a pleasure to be part of this campaign by @iwcwatches
#IWCwatches.
#IWCON #IWCPilot', 'post_hashtags': ['#IWCwatches', '#IWCON', '#IWCPilot'], 'likes': 631260, 'type': 'video/mp4'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/193616713_793489234639881_2394023280398508351_n.jpg?stp=dst-jpg_e35_s1080x1080&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=109&_nc_ohc=DdYTcelmwIkAX8ddIoU&edm=APU89FABAAAA&ccb=7-4&oh=00_AT-ldqWP3aDiMv2Y6V9CEN1uYHYF_L8NxvFS7LF3ZJ9YAw&oe=626F9E85&_nc_sid=86f79a': {'post_date': '2021-05-31T14:38:41.000Z', 'post_bio': 'I feel truly blessed to have a strong relationship with the most important man in my life, my dad. How far we have come together! The journey before Formula 1 is where my best memories are. Travelling around the U.K. in our old Motorhome, as a family. If it wasn‚Äôt for you I‚Äôd be nothing, thank you for being the male figure guiding me through my life. I wouldn‚Äôt be where I am today nor would I be the man I am today. I am forever grateful for you, I am immensely proud of you and just want to wish you a Happy Birthday Dad. There is so much life ahead of you, let‚Äôs live it together and create great memories to last eternity. üôèüèæ #happybirthday #hero', 'post_hashtags': ['#happybirthday', '#hero'], 'likes': 748315, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/193876122_2926089431042931_2059719248533392131_n.jpg?stp=c157.0.405.405a_dst-jpg_e35&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=103&_nc_ohc=uCgCxGkrtdgAX-LjaVu&tn=ZRY-MpqNu-mBjEbd&edm=APU89FABAAAA&ccb=7-4&oh=00_AT8g0IB8e38_5l4mDG8R_NF13Tfo7fdNX0iYfimLrr1Fug&oe=626A2BE0&_nc_sid=86f79a': {'post_date': '2021-05-30T11:09:47.000Z', 'post_bio': 'I‚Äôve been learning to sky dive over the past couple years. It‚Äôs one of my favourite things to do in my spare time. This me trying for the first time flying on my back of which I was useless at lol. After this I went to spend time in the wind tunnel to practice. I‚Äôll post that next to show you my progression. ü§òüèæ', 'post_hashtags': [], 'likes': 3437850, 'type': 'video/mp4'}}, {'https://scontent-lhr8-2.cdninstagram.com/v/t51.2885-15/191125376_142405491208957_5045687839640829914_n.jpg?stp=dst-jpg_e35_s1080x1080&_nc_ht=scontent-lhr8-2.cdninstagram.com&_nc_cat=101&_nc_ohc=F9CQ_dv1slkAX8HnvOp&edm=APU89FABAAAA&ccb=7-4&oh=00_AT84NxC-TJPWlGpsP2VnWLUQ9HRM-hm-l2_YbiKKiXLeYw&oe=626F2EF6&_nc_sid=86f79a': {'post_date': '2021-05-25T09:07:15.000Z', 'post_bio': 'What does justice mean for a daughter who lost her dad? For a woman who lost her partner? For a man who lost his brother? What does justice mean when a man‚Äôs life is stolen because of nothing more than the colour of his skin?

George wasn‚Äôt supposed to die that day. One year later, the impact of his life and it‚Äôs unfair ending remains with us. Today, we will mourn George and keep his loved ones in our prayers. 

But how can we achieve real justice for him, and the many lives stolen before and after his?

We never forget. We continue our work. We believe in a world where children like George‚Äôs don‚Äôt have to worry about whether their dad will come home at night. Where every black person can walk down the street with the belief that this world was made for them. We work to build an equal world for George, for his children, and for all the other victims of racism. 

