ashtags': [], 'likes': 724955, 'type': 'photo'}}, {'https://scontent-lhr8-2.cdninstagram.com/v/t51.2885-15/175955027_3243672889069732_7451986182251268073_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-2.cdninstagram.com&_nc_cat=104&_nc_ohc=aVRtP2R6jqgAX_2-yOA&tn=ZRY-MpqNu-mBjEbd&edm=APU89FABAAAA&ccb=7-4&oh=00_AT_lin0JEKW7xj9S355NPM77sUyoEsG1ijlsfke6KAVDIw&oe=626EB4B0&_nc_sid=86f79a': {'post_date': '2021-04-21T16:39:21.000Z', 'post_bio': 'Roscoe ‚ù§Ô∏èüê∂', 'post_hashtags': [], 'likes': 526325, 'type': 'photo'}}, {'https://scontent-lhr8-2.cdninstagram.com/v/t51.2885-15/175341276_1070921636733760_907424998790749552_n.jpg?stp=dst-jpg_e35_p1080x1080&_nc_ht=scontent-lhr8-2.cdninstagram.com&_nc_cat=104&_nc_ohc=sQYF9MSR4q4AX8CoMRv&edm=APU89FABAAAA&ccb=7-4&oh=00_AT83GyGZcsezJwrn9xPn9rAmhtBww7umu-O0hXGstmQ9zg&oe=626F4E18&_nc_sid=86f79a': {'post_date': '2021-04-20T21:35:42.000Z', 'post_bio': 'JUSTICE for George! The emotions I feel right now are hard to describe. Derek Chauvin has been found guilty. This is the first time that a white officer has been convicted for killing a black man in Minnesota. This is monumental, George‚Äôs death is not in vain.

The result of the Derek Chauvin trial today is the right one. Convicting him of all three charges marks a new dawn in the fight for racial justice. 

This trial was an opportunity for the justice system to hold Derek Chauvin accountable for his actions when he took the life of George Floyd. We can now breathe a collective sigh of relief that the right decision has been met, and that justice has been served. 

Today‚Äôs outcome is a sombre victory for George and his family, but it shows that our efforts to promote justice are not in vain. Black voices have been heard and action is happening. When we stand together, we can make a difference. 

But this is just one step on the path towards a more equal society. Since George‚Äôs death, so many other Black people have died at the hands of the police and we must ensure the momentum of today continues. The fight isn‚Äôt over, and there is more to be done, but we can consider today a glimmer of hope.

My thoughts and prayers are with George‚Äôs family. I hope they will feel a sense of peace from this result. #BlackLivesMatter', 'post_hashtags': ['#BlackLivesMatter'], 'likes': 767171, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/175671975_510335236793331_8753720655728449711_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=103&_nc_ohc=C1ET70l8qaAAX8t1mVB&edm=APU89FABAAAA&ccb=7-4&oh=00_AT_3N6zgooLTfLvUCk007hxyBOk7xYb6tQG0i1hOBe9MVA&oe=626A355A&_nc_sid=86f79a': {'post_date': '2021-04-20T17:27:59.000Z', 'post_bio': 'Those were the days üôèüèæ', 'post_hashtags': [], 'likes': 2256158, 'type': 'video/mp4'}}, {'https://scontent-lhr8-2.cdninstagram.com/v/t51.2885-15/175906378_4067736509975585_4201798105635197493_n.jpg?stp=dst-jpg_e35&_nc_ht=scontent-lhr8-2.cdninstagram.com&_nc_cat=105&_nc_ohc=noGVzVFLkCMAX8wcJJe&tn=ZRY-MpqNu-mBjEbd&edm=APU89FABAAAA&ccb=7-4&oh=00_AT-V91URCQcFWU58GX7oOmfM3lUAu90aej2CTunri2ZGog&oe=626ABBEB&_nc_sid=86f79a': {'post_date': '2021-04-19T12:41:55.000Z', 'post_bio': 'I‚Äôve always been that skinny dude. Partly because of my job but mostly due to misguidance on diet, training, lack of certain workouts and bad sleep. Training is a struggle for me, it always has been. There are days when I just don‚Äôt have the motivation, days I hate my body, days where I feel fat or too skinny. My weight fluctuates a lot, up and down 2-3kg weekly depending on sleep, water and training. Remaining consistent is key but most important of all is eating right. This is also not easy as I‚Äôm sure you know but we have to keep trying. This is me after a good session this morning. Remember, working out releases endorphins that kick start your day positively so if you‚Äôre anything like me and struggle with mental health, training is a huge player in helping keep you on a positive. Go have an awesome week!üí™üèæ #staypositive', 'post_hashtags': ['#staypositive'], 'likes': 928808, 'type': 'video/mp4'}}, {'h