61 years ago today, the day police in South Africa killed 69 people at a peaceful demonstration. I can‚Äôt help but reflect on the incredible young people around the world who have protested against racial injustice in the last year.

I believe today‚Äôs youth are tomorrow‚Äôs leaders. They‚Äôre already making huge strides towards positive change and I cannot wait to see what else they‚Äôre able to achieve.

However, we all have an integral part to play. It‚Äôs no longer enough to talk about ending racism. We need to follow through on what we have committed to, and hold ourselves and others accountable.

We should all continue to push towards equality for future generations. We can always do more. How are you fighting for change? @unitednations #FightRacism', 'post_hashtags': ['#FightRacism'], 'likes': 345125, 'type': 'photo'}}, {'https://scontent-lhr8-2.cdninstagram.com/v/t51.2885-15/162104248_1144830292628669_1836612113836102374_n.jpg?stp=dst-jpg_e35_s1080x1080&_nc_ht=scontent-lhr8-2.cdninstagram.com&_nc_cat=105&_nc_ohc=kzQXjlzNUFgAX_SV833&tn=ZRY-MpqNu-mBjEbd&edm=APU89FABAAAA&ccb=7-4&oh=00_AT-0QGII9wcK-5iY-t--e9LMi-KjOdZ-ZWXDzv5bskI1Bg&oe=626F3B3A&_nc_sid=86f79a': {'post_date': '2021-03-20T11:17:05.000Z', 'post_bio': 'The Hamilton Commission is ongoing. There is so much work happening in the background, with so many wonderful people, taking the time to help tackle some serious issues that prevent young Black people getting through into STEM careers. Days like today excite, inspire and motivate me to keep pushing. I feel optimistic for our future and the change we can bring together.', 'post_hashtags': [], 'likes': 567022, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/161705179_1056265701564999_8215266265720663441_n.jpg?stp=c0.83.1078.1078a_dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=103&_nc_ohc=oSsB-C3X4QoAX-wwfwm&edm=APU89FABAAAA&ccb=7-4&oh=00_AT_eE3E8myJLxDKb9nenhSArddwGlNM8CETxGMGVrSkhSg&oe=626FBCC9&_nc_sid=86f79a': {'post_date': '2021-03-19T16:04:26.000Z', 'post_bio': 'Mans garms were fresh since day 1 ü§£', 'post_hashtags': [], 'likes': 432829, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/162044991_248891223609800_4492317989149320148_n.jpg?stp=dst-jpg_e35_s1080x1080&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=108&_nc_ohc=iDjPLHGVcMcAX_70XjW&edm=APU89FABAAAA&ccb=7-4&oh=00_AT93szqaKntEDsHWXYx6k232lKnkkxwV2_db0rQ0YrC4NQ&oe=626EDDEB&_nc_sid=86f79a': {'post_date': '2021-03-17T18:24:40.000Z', 'post_bio': 'He probably doesn‚Äôt know this but Kelly changed my life for the better. I want you all to know how great of a human being this man is. I am forever grateful for the time you have given me, for the insight and your passion for the waves. Thank you @kellyslater! Can‚Äôt wait until we can hit the waves again üôèüèæ', 'post_hashtags': [], 'likes': 528721, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/159139267_1835328513309042_4324748283188082342_n.jpg?stp=c0.180.1440.1440a_dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=106&_nc_ohc=jWj7A-ruUcwAX-yTar-&edm=APU89FABAAAA&ccb=7-4&oh=00_AT_WPnc1U9IwaSiniWb3lhjsGsU-G1n0JraIA2RAx5DkFg&oe=626FDEA0&_nc_sid=86f79a': {'post_date': '2021-03-12T12:57:08.000Z', 'post_bio': 'Man on a mission.', 'post_hashtags': [], 'likes': 803205, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/157832022_188909245988982_2736441392528360281_n.jpg?stp=dst-jpg_e35&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=106&_nc_ohc=Y1TM3NiZ-r0AX-BvYIm&edm=APU89FABAAAA&ccb=7-4&oh=00_AT8HoCyeBiESzGgqHVLcuwyHfenB_eiJRSfinqUlMrEf5A&oe=626F60D5&_nc_sid=86f79a': {'post_date': '2021-03-08T20:12:45.000Z', 'post_bio': 'Today I‚Äôm celebrating all of the powerful women who have helped shape the world we live in today. I will always be grateful for the sacrifices they have made and the challenges they‚Äôve overcome. Today and every day I am grateful to have grown in their light.
Happy #InternationalWomensDay', 'post_hashtags': ['#InternationalWomensDay'], 'likes': 621627, 'type': 'photo'}}, {'https://scontent-lhr8-2.cdninstagram.com/v/t51.2885-15/156342669_644099239683697_4098262239826599568_n.jpg?stp=dst-jpg_e35_p1080x1080&_nc_ht=scontent-lhr8-2.cdninstagram.com&_nc_cat=101&_nc_ohc=Shy3364WmnkAX92-Pl6&edm=APU89FABAAAA&ccb=7-4&oh=00_AT8PTIM8DTyYSdWNQg9koNSCR9YVXuKQF91LYWpNSZ9DOw&oe=626E4F7B&_nc_sid=86f79a': {'post_date': '2021-03-04T17:57:58.000Z', 'post_bio': 'No Room For Racism. Challenge it. Report it. Change it. #NoRoomForRacism @PremierLeague @EASPORTSFIFA #FIFA21', 'post_hashtags': ['#NoRoomForRacism', '#FIFA21'], 'likes': 313698, 'type': 'photo'}}, {'https://scontent-lhr8-2.cdninstagram.com/v/t51.2885-15/156282891_187870672722374_3909183827036358368_n.jpg?stp=dst-jpg_e35_s1080x1080&_nc_ht=scontent-lhr8-2.cdninstagram.com&_nc_cat=102&_nc_ohc=rSPVQ9RYTZwAX-dLs8t&edm=APU89FABAAAA&ccb=7-4&oh=00_AT8BiQXydk_5jjbPwjm_kaSmTqrPuIhIcaTLM6PERDRCqw&oe=626E54E9&_nc_sid=86f79a': {'post_date': '2021-03-03T18:50:17.000Z', 'post_bio': 'My squad roll deep at almost 2000 people to craft this machine Into the beast it is. Super proud of everyone especially through this challenging time in life. #W12', 'post_hashtags': ['#W12'], 'likes': 942681, 'type': 'photo'}}, {'https://scontent-lhr8-2.cdninstagram.com/v/t51.2885-15/155064506_2923073854594274_209921132416835946_n.jpg?stp=dst-jpg_e35_p1080x1080&_nc_ht=scontent-lhr8-2.cdninstagram.com&_nc_cat=102&_nc_ohc=nZNMplQ5BD4AX_-uPcJ&edm=APU89FABAAAA&ccb=7-4&oh=00_AT-8djqCrmO6K7727YDV-W3-g2wHZRCSciyj1fHGpExr4g&oe=626F76FD&_nc_sid=86f79a': {'post_date': '2021-03-01T17:05:27.000Z', 'post_bio': 'Ever since my Dad would play vinyls in the house or as we‚Äôd drive cross country from race to race, music has been a love and passion that brings creativity and happiness. I remember playing around on garage band, DJing, or even strumming the guitar in the passengers seat. At first my voice was wobbly and I wasn‚Äôt terribly good, but I‚Äôve kept at it. Even though I‚Äôve got a long ways to improve, it‚Äôs rewarding to see the work pay off. I love the balance days like these bring into my life ‚Äî in the home studio dreaming up music. How do you find that balance?', 'post_hashtags': [], 'likes': 433010, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/153588393_827727141419793_4309864999909506917_n.jpg?stp=c0.85.1011.1011a_dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=109&_nc_ohc=GNvv0aG-2gsAX_hsqho&edm=APU89FABAAAA&ccb=7-4&oh=00_AT_Gfu_YqLAmFcWqS_m-_kNovuFAj_sxlpe_2drZcqUKNg&oe=626F68D6&_nc_sid=86f79a': {'post_date': '2021-02-27T18:44:17.000Z', 'post_bio': 'I would snakeboard a lot when I was younger. My dad used to roller dance in his younger days and I found his old skates. I cleaned a bunch of cars to save up to buy a snakeboard because it was different and I took the wheels off of his skates which had amazing bearings on and soft wheels and put them on my board. At kart tracks this was how I got around.', 'post_hashtags': [], 'likes': 520897, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/154121251_798904147381319_6837466602691923578_n.jpg?stp=c0.180.1440.1440a_dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=111&_nc_ohc=27kXS7FCoXgAX9ADNEj&tn=ZRY-MpqNu-mBjEbd&edm=APU89FABAAAA&ccb=7-4&oh=00_AT8ZZmLjvnMta6iYQKEZHIUzmituf4EbX5-hLzPd_rVdTg&oe=626F4F5E&_nc_sid=86f79a': {'post_date': '2021-02-26T11:51:59.000Z', 'post_bio': 'Black Lives Matter. Last year some of us took a knee in support of equality which I am proud of. My question is, what‚Äôs next? The inequities within our sport and within the world persist. Change is still needed. We must keep pushing to hold ourselves and others accountable. We have to keep striving for equality for all, in order to continue to see true and lasting change in our world. As long as I have air in my lungs, I will continue to fight for change in everything I do. I will work to create pathways and opportunities for kids of colour, within sciences, engineering and creative disciplines. Let‚Äôs keep pushing. What are you committed to?', 'post_hashtags': [], 'likes': 594327, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/153682408_577493456543148_2871604921053232989_n.jpg?stp=dst-jpg_e35_p1080x1080&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=100&_nc_ohc=p6XF1v-nDD8AX9FTmwV&tn=ZRY-MpqNu-mBjEbd&edm=APU89FABAAAA&ccb=7-4&oh=00_AT9eAaOpYf8w-wgXhKCvvyWmPUrcirqQS4CvGzAxvmShfw&oe=626F6322&_nc_sid=86f79a': {'post_date': '2021-02-25T17:02:53.000Z', 'post_bio': 'Surfing is one of my favorite sports‚Äî outside of racing. I love sitting out beyond the waves, feeling the ocean around me, it makes me appreciate the power that‚Äôs around us everyday. Emotionally and physically this has been a challenging break, but the opportunity to get in the waves has cleared my mind and opened me up to the beauty around us.

I hope to one day surf everyday. Catching that perfect wave and riding it into the sunset. This is me speaking it into existence. If you have a dream, don‚Äôt let anybody tell you you can‚Äôt achieve it. Manifest those dreams by putting your all into it and never giving up.', 'post_hashtags': [], 'likes': 554496, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/163649984_4184032471628724_2679944373470499956_n.jpg?stp=dst-jpg_e35&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=100&_nc_ohc=Jiy17RqmYCUAX-DZHM9&edm=ALQROFkBAAAA&ccb=7-4&ig_cache_key=MjUzNTAyMDQzMjc2MTE0NDY2MQ%3D%3D.2-ccb7-4&oh=00_AT-dzQz6Mg_XmrtIk7P_WfZ7WF0YT9liJW-MictsX__qng&oe=626E99C4&_nc_sid=30a2ef': {'post_date': '2021-03-22T13:02:17.000Z', 'post_bio': 'Love everything you do

Not great at playing but the point is I love it and that‚Äôs all that mattersüôèüèæ', 'post_hashtags': [], 'likes': 1379391, 'type': 'video/mp4'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/161705179_1056265701564999_8215266265720663441_n.jpg?stp=dst-jpg_e35&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=103&_nc_ohc=oSsB-C3X4QoAX-wwfwm&edm=ALQROFkBAAAA&ccb=7-4&ig_cache_key=MjUzMjkzODg4NjQ2NTY3NTI0NQ%3D%3D.2-ccb7-4&oh=00_AT8Fxfo5jVImJqkvnInHZTz0mkJFss9Ao2N2qeKY1kTBWw&oe=626FBCC9&_nc_sid=30a2ef': {'post_date': '2021-03-19T16:04:26.000Z', 'post_bio': 'Mans garms were fresh since day 1 ü§£', 'post_hashtags': [], 'likes': 432829, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/159139267_1835328513309042_4324748283188082342_n.jpg?stp=dst-jpg_e35&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=106&_nc_ohc=jWj7A-ruUcwAX-yTar-&edm=ALQROFkBAAAA&ccb=7-4&ig_cache_key=MjUyNzc3MTE4NDQ1NzM4ODM4NA%3D%3D.2-ccb7-4&oh=00_AT-u27XGV31QvRa6ji9tmAqZI3cl-uRMXQhuLLlET5uLXg&oe=626FDEA0&_nc_sid=30a2ef': {'post_date': '2021-03-12T12:57:08.000Z', 'post_bio': 'Man on a mission.', 'post_hashtags': [], 'likes': 803205, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/153588393_827727141419793_4309864999909506917_n.jpg?stp=dst-jpg_e35&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=109&_nc_ohc=GNvv0aG-2gsAX_hsqho&edm=ALQROFkBAAAA&ccb=7-4&ig_cache_key=MjUxODUyMzgyNDI3OTY3ODIxMg%3D%3D.2-ccb7-4&oh=00_AT8VJknACanxa1qFSToq-0iE75B6MyqMDdwWNqrWJpo6Gw&oe=626F68D6&_nc_sid=30a2ef': {'post_date': '2021-02-27T18:44:17.000Z', 'post_bio': 'I would snakeboard a lot when I was younger. My dad used to roller dance in his younger days and I found his old skates. I cleaned a bunch of cars to save up to buy a snakeboard because it was different and I took the wheels off of his skates which had amazing bearings on and soft wheels and put them on my board. At kart tracks this was how I got around.', 'post_hashtags': [], 'likes': 520897, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/154121251_798904147381319_6837466602691923578_n.jpg?stp=dst-jpg_e35&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=111&_nc_ohc=27kXS7FCoXgAX9ADNEj&tn=ZRY-MpqNu-mBjEbd&edm=ALQROFkBAAAA&ccb=7-4&ig_cache_key=MjUxNzU5MTUzMjI3MTIzODk0Ng%3D%3D.2-ccb7-4&oh=00_AT8HZG3imrG04qWaYp0amxurFR_P9lJrSeT25XnzS3mKkw&oe=626F4F5E&_nc_sid=30a2ef': {'post_date': '2021-02-26T11:51:59.000Z', 'post_bio': 'Black Lives Matter. Last year some of us took a knee in support of equality which I am proud of. My question is, what‚Äôs next? The inequities within our sport and within the world persist. Change is still needed. We must keep pushing to hold ourselves and others accountable. We have to keep striving for equality for all, in order to continue to see true and lasting change in our world. As long as I have air in my lungs, I will continue to fight for change in everything I do. I will work to create pathways and opportunities for kids of colour, within sciences, engineering and creative disciplines. Let‚Äôs keep pushing. What are you committed to?', 'post_hashtags': [], 'likes': 594327, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/149031238_703070320370528_5283492293374661981_n.jpg?stp=c0.180.1440.1440a_dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=108&_nc_ohc=rnEvJ8dW1wwAX_AwSEk&tn=ZRY-MpqNu-mBjEbd&edm=APU89FABAAAA&ccb=7-4&oh=00_AT-KUOXiRiPNk5ekWiN8I8m64cO3tCnyDlDVLN2UtYLaSA&oe=626FE2F7&_nc_sid=86f79a': {'post_date': '2021-02-12T18:16:39.000Z', 'post_bio': 'Hey guys, sorry I‚Äôve been absent from here for a while, I‚Äôve been focusing and preparing for the season ahead. I consider myself lucky to have had this time to reflect and prepare. I remain positive and excited for the season ahead but want you all to know that I‚Äôm thinking of you out there, hoping you are well. I miss so many of you and can‚Äôt wait to hopefully see you again soon if not in person then online. But one thing is for sure I‚Äôll be racing my heart out for you this year!', 'post_hashtags': [], 'likes': 673225, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/146774624_420106985908763_4884593402712629520_n.jpg?stp=c0.179.1440.1440a_dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=111&_nc_ohc=inXSfG9y-N4AX_1UjWv&edm=APU89FABAAAA&ccb=7-4&oh=00_AT9aFw12AiWGTyH5Vc6_87j9QJdAT4TfXUFwMKMH9IcpQQ&oe=626F26EF&_nc_sid=86f79a': {'post_date': '2021-02-08T03:53:28.000Z', 'post_bio': 'The greatest to ever do it. Congrats brother @tombrady on your 7th Super Bowl win. Welcome to #7 !!!', 'post_hashtags': ['#7'], 'likes': 658715, 'type': 'photo'}}, {'https://scontent-lhr8-2.cdninstagram.com/v/t51.2885-15/142418974_276693287121064_2130150219773411207_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-2.cdninstagram.com&_nc_cat=104&_nc_ohc=kPptZtQG0C8AX8QaPQE&edm=APU89FABAAAA&ccb=7-4&oh=00_AT_HjgR5SS0kkiAzHZI14b7fj43CU2olxiLxcgbTSbiZ9w&oe=626F3EB9&_nc_sid=86f79a': {'post_date': '2021-01-27T18:56:05.000Z', 'post_bio': 'Every morning I hike to the top of this mountain and I take some time to set my goals and intentions for the day. I‚Äôve been training every day and at these altitudes, I find it‚Äôs the perfect place to push my mind and body to new heights to prep myself for the year and season ahead. Today, I‚Äôm sending you all positivity and light. I know these uncertain times can be dark but I want to ask that you don‚Äôt lose sight of your goals. Let‚Äôs keep each other motivated and focused. I believe in you. #TeamLH', 'post_hashtags': ['#TeamLH'], 'likes': 558139, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/141858326_740255713541492_5766909205934393402_n.jpg?stp=c0.167.1440.1440a_dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=108&_nc_ohc=8C0AtmjGuJ8AX8GssXK&tn=ZRY-MpqNu-mBjEbd&edm=APU89FABAAAA&ccb=7-4&oh=00_AT-itBDZi5Qu1Hv2iSwh7FHKvXaawAAfWjQ3dVfQ1-i9ew&oe=626FE4A9&_nc_sid=86f79a': {'post_date': '2021-01-26T15:56:19.000Z', 'post_bio': 'It‚Äôs hard to believe it‚Äôs been a year today when we lost these two special spirits. Life is so precious, one minute we are here and the next, we‚Äôre gone. But the love and memory left behind of these two is still so fresh and strong. We can not forget their spark and the difference they made to the world. Thinking about these two and the all of the lives lost in this tragic accident, one year ago todayüôèüèæ', 'post_hashtags': [], 'likes': 632298, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/142163652_446003513100837_7809681532803082905_n.jpg?stp=c240.0.959.959a_dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=109&_nc_ohc=Y_ha_qrEI0cAX-OECRT&edm=APU89FABAAAA&ccb=7-4&oh=00_AT8nte-VPkBFuLlpQ9X1Sn_A1XsyqySDj67me6BU0e6d_A&oe=626F1C1E&_nc_sid=86f79a': {'post_date': '2021-01-24T18:52:24.000Z', 'post_bio': 'Roscoe‚Äôs Sunday vibe. Happy Sunday world üôåüèæ', 'post_hashtags': [], 'likes': 470378, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/140332932_458967331938153_3255079379790177777_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=109&_nc_ohc=9rSG_eHlRqQAX983kEN&edm=APU89FABAAAA&ccb=7-4&oh=00_AT8KwbLmJ_wU9nt2gRyEr5s91zT_lc1xXxHhhEigC4vvXQ&oe=626A5EE3&_nc_sid=86f79a': {'post_date': '2021-01-22T19:16:28.000Z', 'post_bio': 'Cross country skiing....at 2000m. This is one of the greatest workouts I‚Äôve discovered over the years. Feeling so focused. I‚Äôm so driven to turn my body into a machine! Focused on my fuel, drinking plenty of water and only water, continuing learning more about my vegan diet, then finding peace and tranquility in all I do and never giving up! Sending you big waves of energyüôåüèæ', 'post_hashtags': [], 'likes': 1416725, 'type': 'video/mp4'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/140375205_186566156528204_8849608014415609179_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=108&_nc_ohc=CP9jqDV-hYoAX-02kRX&tn=ZRY-MpqNu-mBjEbd&edm=APU89FABAAAA&ccb=7-4&oh=00_AT8k1_i2WOn5Mj1yV02cW4UKn9PJidwe5FkP2NuORZ78Wg&oe=626AC8D5&_nc_sid=86f79a': {'post_date': '2021-01-21T17:23:50.000Z', 'post_bio': 'This is at 3400m. Starting at 2400m. The air is so thin, it‚Äôs harder to breath which is perfect for pushing the body. I‚Äôm at the end of the hike here, perfect start to the morning followed by cross country skiing which I‚Äôm not the greatest at but I get by. #building', 'post_hashtags': ['#building'], 'likes': 1377916, 'type': 'video/mp4'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/140597710_431204164690699_5890691360343141653_n.jpg?stp=c0.186.480.480a_dst-jpg_e35&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=107&_nc_ohc=rWpIIspIDdIAX-ZgPwj&edm=APU89FABAAAA&ccb=7-4&oh=00_AT_j61Rn_77E7ccD42kcMMACjUIjz1ImrpLVQ5HkHSqsKw&oe=626A9B94&_nc_sid=86f79a': {'post_date': '2021-01-20T20:50:09.000Z', 'post_bio': '‚ÄúThe Hill We Climb‚Äù

What an amazing poem by @amandascgorman üëèüèæ. Amanda happens to be the youngest inaugural poet in American history.', 'post_hashtags': [], 'likes': 2007921, 'type': 'video/mp4'}}, {'https://scontent-lhr8-2.cdninstagram.com/v/t51.2885-15/140074772_3655623921186232_2427246697757581626_n.jpg?stp=dst-jpg_e35&_nc_ht=scontent-lhr8-2.cdninstagram.com&_nc_cat=104&_nc_ohc=5E6--JK6_E8AX-yTBj8&edm=APU89FABAAAA&ccb=7-4&oh=00_AT-e-C58ErZZlGa1O4OKh1NWldSfGB3MHLU3hHp1phl1Dw&oe=626E5CE0&_nc_sid=86f79a': {'post_date': '2021-01-20T18:22:04.000Z', 'post_bio': 'A historic day in America. Today brings so much hope for the future, an example of diversity in leadership that I hope to see mirrored across industries and governments. Congratulations @joebiden and @kamalaharris, best of luck.', 'post_hashtags': [], 'likes': 610453, 'type': 'photo'}}, {'https://scontent-lhr8-2.cdninstagram.com/v/t51.2885-15/139517868_3530717170383434_4976457439966747746_n.jpg?stp=c0.90.720.720a_dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-2.cdninstagram.com&_nc_cat=102&_nc_ohc=M11izcQJe74AX-g8hg8&edm=APU89FABAAAA&ccb=7-4&oh=00_AT8zGGu5G2FHLVywR1FLQXkW6LWVeQiHCnH88RdUvZ55eQ&oe=626A2EB5&_nc_sid=86f79a': {'post_date': '2021-01-18T21:13:14.000Z', 'post_bio': 'Hey World, I haven‚Äôt been on here for a while. I‚Äôm in the mountains training everyday, getting my mind and body right. I‚Äôm hiking to the top of the mountain every morning. 3 of those hikes I cross country ski once I get to the top which is at 3400m, killer. I love altitude training, there is less oxygen high up so working out is much harder than at sea level, just walking up the stairs you feel it at 2000m. Normally when I finish training here and return to sea level running is such a breeze. I‚Äôm trying to find the right balance in cardio and strength building. On top of that, lots of work ongoing in the background. Many moving parts but just checking in to let you know I‚Äôm doing good, I‚Äôm healthy and mentally strong right now in my bubble