Story and photographs: @misanharriman Stylist: @elgarjohnson Grooming: @yukomua Hair: #KerryAnnChristopher Barber: #AinsworthRamsay', 'post_hashtags': ['#KerryAnnChristopher', '#AinsworthRamsay'], 'likes': 997067, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/127137852_750911242438374_8536240774530311937_n.jpg?stp=dst-jpg_e35_s1080x1080&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=106&_nc_ohc=1kJHija5pbsAX9rPO6J&tn=ZRY-MpqNu-mBjEbd&edm=APU89FABAAAA&ccb=7-4&oh=00_AT-6ewYunGZxsld9OKYjVuyQzacjRJE-KJSPngZFD-DgCg&oe=626F48CC&_nc_sid=86f79a': {'post_date': '2020-11-25T15:05:25.000Z', 'post_bio': 'Taking the time to rest and reflect. We all need a break, this year more than ever. Personally, I love to escape by watching TV. My #LGSIGNATURE TV creates a totally immersive experience through the crystal-clear images and premium audio, it‚Äôs so easy to get lost in whatever I am watching. #LGSIGNATURExLewis #LGOLED8K', 'post_hashtags': ['#LGSIGNATURE', '#LGSIGNATURExLewis', '#LGOLED8K'], 'likes': 493370, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/126992468_693676738244652_1923226306222508409_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=100&_nc_ohc=XjKe_ncUzrUAX-I6qaU&edm=APU89FABAAAA&ccb=7-4&oh=00_AT_fW2ZNKXarPeQPhT3InKzUy3bPJeOOt3BniZSEtAMK_w&oe=626EFB08&_nc_sid=86f79a': {'post_date': '2020-11-23T17:03:20.000Z', 'post_bio': 'It‚Äôs so important that we fight for those that don‚Äôt have a voice, animal rights and protecting our planet‚Äôs amazing wildlife. The illegal wildlife trade continues to thrive and it damages our environment and threatens endangered species. That‚Äôs why I‚Äôm supporting Art for Animals, a campaign set up by conservation charity @SpaceForGiants which help to empower frontline law enforcers and prosecutors in stopping wildlife criminals across various African and Asian countries.

Exclusive prints by the brilliant wildlife photographers @davidyarrow and Adrian Steirn are available now with 100% of proceeds from these limited-edition pieces going to the charity. I‚Äôve chosen this beautiful image and am buying one, if you‚Äôd like your own and to support this incredible cause, please click on the link in my bio or swipe up in my stories.', 'post_hashtags': [], 'likes': 350831, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/126219934_2715977862000419_7702680392349727691_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=111&_nc_ohc=RJkSIag3pykAX_eGqgJ&edm=APU89FABAAAA&ccb=7-4&oh=00_AT-8D1KA968ocqgcmXLxxATVugGi2SN2WAbaBl94ZXPInQ&oe=626A7BAF&_nc_sid=86f79a': {'post_date': '2020-11-22T17:31:28.000Z', 'post_bio': 'So my dad and I aren‚Äôt great at tennis but we are trying to get better. I always use a slice to beat him and he always falls for it. He‚Äôs now learnt it and finally got me todayü§£ When people ask me, how will you celebrate? We‚Äôve got life to celebrate and spending time with family is how I am celebrating. #familyiseverything #dad @serenawilliams HELP! ü§£', 'post_hashtags': ['#familyiseverything', '#dad'], 'likes': 4846213, 'type': 'video/mp4'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/125534255_124437812566512_6491887239788123422_n.jpg?stp=c128.0.768.768a_dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=100&_nc_ohc=zjxCbJnMa3kAX_cZHrY&edm=APU89FABAAAA&ccb=7-4&oh=00_AT_5RNVHYxd2R-6OIlEcv2YwZ2OF9Xwdi1-b5AqoXxCMvg&oe=626F3428&_nc_sid=86f79a': {'post_date': '2020-11-17T16:03:21.000Z', 'post_bio': 'Lazy days üò¥', 'post_hashtags': [], 'likes': 920573, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/125816294_937151493485684_3956641011945499539_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=108&_nc_ohc=kB2iplnH8YgAX_JxhFG&edm=APU89FABAAAA&ccb=7-4&oh=00_AT-hEQwpCJNnISaBXiKItug8OgvJ8ZetKiZip3KrHhG-tw&oe=626ABF40&_nc_sid=86f79a': {'post_date': '2020-11-16T14:10:13.000Z', 'post_bio': 'Hey World! Woke up today feeling super grateful and bless for another day. I hope you started your week with positivity, I‚Äôm sending you someüñ§üôèüèæ', 'post_hashtags': [], 'likes': 4661879, 'type': 'video/mp4'}}, {'https://scontent-lhr8-2.cdninstagram.com/v/t51.2885-15/125219532_726008821377542_442849575796982203_n.jpg?stp=dst-jpg_e35_s1080x1080&_nc_ht=scontent-lhr8-2.cdninstagram.com&_nc_cat=102&_nc_ohc=JMGLr3MShW8AX_3lFXl&edm=APU89FABAAAA&ccb=7-4&oh=00_AT-B-NSdZH1c_QOBYZRlvG1L3a1O-VZG4TdRSasKxpRHbQ&oe=627008B7&_nc_sid=86f79a': {'post_date': '2020-11-15T15:54:34.000Z', 'post_bio': 'A day i‚Äôll never forget üèÜ#S7ILLRISING', 'post_hashtags': ['#S7ILLRISING'], 'likes': 2080452, 'type': 'photo'}}, {'https://scontent-lhr8-2.cdninstagram.com/v/t51.2885-15/125303451_2770418343220166_3643481025657272634_n.jpg?stp=c0.180.1440.1440a_dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-2.cdninstagram.com&_nc_cat=102&_nc_ohc=rm7glLdY1xYAX_hOMlp&edm=APU89FABAAAA&ccb=7-4&oh=00_AT-7mwvE8f8GccD-kqmTUTvXq8z17gkY6JehTh-63FBv3A&oe=626EC7BF&_nc_sid=86f79a': {'post_date': '2020-11-15T13:59:08.000Z', 'post_bio': 'Leading up to today and even after I crossed the line, I‚Äôve been gathering my thoughts about what‚Äôs most important to me. This year has been so unpredictable. With the pandemic and obviously the season being pushed back by several months, I had the most downtime I‚Äôve ever had in my life. It gave me the chance to really think about my ultimate purpose. Seven World Championships means the world to me, I can‚Äôt even describe how much, but there‚Äôs still another race we‚Äôve yet to win.

This year I‚Äôve been driven not just by my desire to win on the track, but by a desire to help push our sport, and our world to become more diverse and inclusive. I promise you I am not going to stop fighting for change. We have a long way to go but I will continue to push for equality within our sport, and within the greater world we live in.

Equaling Michael Schumacher‚Äôs record puts a spotlight on me that I know won‚Äôt be here forever. So, while you‚Äôre here, paying attention, I want to ask everyone to do their part in helping to create a more equal world. Let‚Äôs be more accepting and kinder to each other. Let‚Äôs make it so that opportunity is not something that is dependent on background or skin colour.

Nothing is impossible. A driving force for me this year has been to set an example for the next generation, to never give up on your dreams. I was told by many that my dream was impossible, yet here I am. I want you to know that you can do it too. Never give up, keep fighting, and let‚Äôs keep rising to the occasion. #S7ILLRISING', 'post_hashtags': ['#S7ILLRISING'], 'likes': 1730719, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/125269734_1016827562130153_3918635718096000054_n.jpg?stp=dst-jpg_e35&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=109&_nc_ohc=vLQFf-i7bPgAX-R7LN-&tn=ZRY-MpqNu-mBjEbd&edm=APU89FABAAAA&ccb=7-4&oh=00_AT_SRj0pDVGybBXqPETy_CnFFkTp89IRpUqGEvgfa6Eklg&oe=626A887E&_nc_sid=86f79a': {'post_date': '2020-11-15T12:36:00.000Z', 'post_bio': '7X Formula 1 World Champion. Wow. To everyone that has supported me along the way, this is for you. To my incredible family, where do I even start? I am eternally grateful for your unconditional love, sacrifices and support. I wholeheartedly dedicate this to all of you, I hope I‚Äôve made you proud today. #TeamLH, you guys have been there for me through absolutely every step of my career, this is for each and every one of you. To my closest friends that have made this challenging season more bearable by continuously lifting my spirits, thank you, this year would have been so much harder without you. To every rival that has pushed me to grow and become better, thank you, I share this with you too. Last but not least, our most amazing team, @mercedesamgf1. We have grown so much together over the years. When we weren‚Äôt winning, we were learning, and getting better, never bitter. We‚Äôve done well on the track but it is our chemistry and bond that is truly unmatched. Thank you, and I share this with every one of you, especially Niki. We miss you every day. #S7ILLRISING üèÜüèÜüèÜüèÜüèÜüèÜüèÜ', 'post_hashtags': ['#TeamLH', '#S7ILLRISING'], 'likes': 2484000, 'type': 'video/mp4'}}, {'ht