What do you think Toto and I were talking about here? üëÄ', 'post_hashtags': [], 'likes': 492852, 'type': 'photo'}}, {'https://scontent-lhr8-2.cdninstagram.com/v/t51.2885-15/124719764_947757295748632_1988810652992403364_n.jpg?stp=c0.186.480.480a_dst-jpg_e35&_nc_ht=scontent-lhr8-2.cdninstagram.com&_nc_cat=104&_nc_ohc=_z8vQyVkxoYAX-gRXP5&tn=ZRY-MpqNu-mBjEbd&edm=APU89FABAAAA&ccb=7-4&oh=00_AT-sJSL4g-eXefyBxTcU69YbpiOUdfc5BrzEp0ttyagzIA&oe=626A3788&_nc_sid=86f79a': {'post_date': '2020-11-13T15:06:22.000Z', 'post_bio': 'GP2 Turkey 2006

This was GP2 (Formula 2) which for those of you that don‚Äôt know, is the last step on the road to F1. I felt so much pressure that year. I was 21 years old and managed to win every championship in previous classes but now in a bigger league. Normally, I won the championship‚Äôs in the second year in other classes, a year for learning and a year for the win. However, the stars were aligning, a seat was a available at McLaren, of whom I was signed to and I thought if I could just win this thing in the first year I could get that seat. So I pushed like never before. In this race, I spun on lap two from Position 6. Fell back and that is a major blow, nobody comes back generally from that. But I had the race of my life and came 2nd. I believe this was probably THE race that sealed my future, I won the championship that year and got promoted to the McLaren F1 team the year after. The rest is history but this race is that showing of never giving up even if it feels impossible. Even if it is impossible, you still have to give it your all no matter what.', 'post_hashtags': [], 'likes': 1831357, 'type': 'video/mp4'}}, {'https://scontent-lhr8-2.cdninstagram.com/v/t51.2885-15/124195319_126301562611372_6998942914451993961_n.jpg?stp=c172.0.376.376a_dst-jpg_e35&_nc_ht=scontent-lhr8-2.cdninstagram.com&_nc_cat=104&_nc_ohc=blw-4Oe9eN0AX_N74Le&edm=APU89FABAAAA&ccb=7-4&oh=00_AT-007egpoXFBS4Rhe6UQAyW8vAnbBFed_gfvoqc171P5A&oe=626ABBD5&_nc_sid=86f79a': {'post_date': '2020-11-12T15:09:13.000Z', 'post_bio': 'As an athlete, there are opportunities that come and go. I take a lot of pride in being very selective with whom I like to partner with. Being someone who loves tech and has so many gadgets, I‚Äôm really proud and grateful to announce a new partnership with @lg_signature. There‚Äôs some real innovation going on with these #LGSIGNATURE products, whilst still keeping an emphasis on art and design. The engineering is so impressive and their appliances all look so slick. Can‚Äôt wait to get them at home now!
