This moment in time I will never forget. We started with nothing, he had 4 jobs to keep me racing at one time and I slept on the couch. We dreamt of doing something, something so far out of reach, becoming an F1 driver. For a family with no money, we may have looked and sounded crazy. People would laugh at us, call us names, joke about us but we kept our heads down. We did our fighting with actions on track. Those who judged us back then, I wonder if they look upon us with hate and anger that we proved them wrong or maybe they‚Äôve grown and think ‚Äúgood for them‚Äù. I like to think the latter. But we did it as a family and we never gave up. So if you‚Äôre out there wondering, doubting yourself, don‚Äôt!! Don‚Äôt give up, keep pushing, keep dreaming and talking that dream to existence. You can do anything you put your mind to, I believe in you and so should you.', 'post_hashtags': [], 'likes': 873794, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/123651535_643028879719032_4983594376515764914_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=100&_nc_ohc=rqw5gr4OU4oAX8AUX6r&edm=APU89FABAAAA&ccb=7-4&oh=00_AT8frn-q4GyQ5LbMA5AC6_3yE5CHbUWyUoGZ2KqH0f53yA&oe=626EBF49&_nc_sid=86f79a': {'post_date': '2020-11-06T18:41:57.000Z', 'post_bio': 'We don‚Äôt deserve dogs. Their loyalty is so fierce, and their love for us is unconditional. Grateful to have my buddy Roscoe with me for a long week of filming.', 'post_hashtags': [], 'likes': 529653, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/123637549_363022491687706_3106446099860632442_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=110&_nc_ohc=9srh28R5VJ4AX_fWzUE&tn=ZRY-MpqNu-mBjEbd&edm=APU89FABAAAA&ccb=7-4&oh=00_AT9CgAKDLX9hhuiG97VyXxrBPKxj2X3JlKldiONtzVCCUw&oe=627002F0&_nc_sid=86f79a': {'post_date': '2020-11-06T12:59:28.000Z', 'post_bio': 'I was 6 years old here when I earned my first two trophies remote control car racing. The small trophy was 2nd place in the electric class championship, against grown men. The bigger was for best new comer in the bigger petrol cars again against men. I was the youngest by at least 15 years. We were also the only people of colour there in a much smaller field. I was so proud, these were some the best days of my life spending time with my dad out the back of the old car we had with our pot noodle soup and bacon sandwiches which was very much an English thing. #1991', 'post_hashtags': ['#1991'], 'likes': 485523, 'type': 'photo'}}, {'https://scontent-lhr8-2.cdninstagram.com/v/t51.2885-15/123563752_1327362770949074_2618264967085046076_n.jpg?stp=dst-jpg_e35_p1080x1080&_nc_ht=scontent-lhr8-2.cdninstagram.com&_nc_cat=102&_nc_ohc=6EPzIowK_VIAX_-Bmaf&edm=APU89FABAAAA&ccb=7-4&oh=00_AT__dE-_3K5Ir7zT-ShomCn5mPvByuo7ojb7nN_jghI50Q&oe=626F8833&_nc_sid=86f79a': {'post_date': '2020-11-05T21:22:20.000Z', 'post_bio': 'No matter what they say, be you!', 'post_hashtags': [], 'likes': 755129, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/123682771_960670644442929_4574315547698544698_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=109&_nc_ohc=zmmVXV2c8CQAX_EEcvQ&edm=APU89FABAAAA&ccb=7-4&oh=00_AT87HHLcxVjgsUGt8LZ1aIJ6AKa24vb7SlKrfvtEFHO64g&oe=626F43C7&_nc_sid=86f79a': {'post_date': '2020-11-05T13:08:50.000Z', 'post_bio': 'I feel so grateful for another day of life in this crazy beautiful world we live in. Wherever you are, no matter what you are going through, know that you can and you will get through it. I‚Äôm thinking of you and sending you positivity. You are stronger than you realise. Keep believing in yourself! I believe in you, and I believe in us. We can get through this pandemic but it‚Äôs going to take us pulling together to do it. Let‚Äôs look out for one another and do what is required to get through this safely. Loveüôèüèæ #onelove', 'post_hashtags': ['#onelove'], 'likes': 575380, 'type': 'photo'}}, {'https://scontent-lhr8-2.cdninstagram.com/v/t51.2885-15/123340178_1034949513644188_8566386942764576981_n.jpg?stp=dst-jpg_e35_s1080x1080&_nc_ht=scontent-lhr8-2.cdninstagram.com&_nc_cat=104&_nc_ohc=60wifbTQvy4AX91k-tr&edm=APU89FABAAAA&ccb=7-4&oh=00_AT9uNzkJdHi8Ht4ql01BNpGPBQe34_Pmgw2Wne3dslDOXw&oe=626E2683&_nc_sid=86f79a': {'post_date': '2020-11-04T16:02:30.000Z', 'post_bio': 'Today, I want to celebrate ‚ÄòThis Is Engineering Day‚Äô. Becoming a Formula 1 driver was my dream as a kid, and I count myself lucky that I‚Äôve been able to make that dream a reality. But none of it would have been possible without my dedicated team of engineers. However ‚Äì what many people don‚Äôt know ‚Äì is not only is there a shortage of skilled engineers in the UK, but only 12% of the current engineering workforce are female and only 9% from diverse backgrounds. Engineering is vital in helping us to solve the numerous challenges we face, from addressing climate change to overcoming the ongoing pandemic. Through the use of technology and innovation, engineering strives to create a society that works for everyone, and we need engineers from all backgrounds to #BeTheDifference. Visit @thisisengineering and click on the link in their bio to find out how engineering is changing our world for the better.', 'post_hashtags': ['#BeTheDifference'], 'likes': 323281, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/123410735_480670502849229_6096500294888611540_n.jpg?stp=c180.0.1080.1080a_dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=109&_nc_ohc=fe6T7EeiOowAX_F4hBH&edm=APU89FABAAAA&ccb=7-4&oh=00_AT-Ox-M7F_u_y3GzPUpXEE0ioCZerwycseDUg8YTUnKa7A&oe=626ED436&_nc_sid=86f79a': {'post_date': '2020-11-03T18:53:42.000Z', 'post_bio': 'Now I know more than anyone how much sweat you put in. If we ever do that again, i‚Äôm using my bootü§£', 'post_hashtags': [], 'likes': 617826, 'type': 'photo'}}, {'https://scontent-lhr8