cally. But I‚Äôve been on it recently and I can tell you, even just doing press-ups and sit ups out of bed in the morning, can make such a difference to the body and mind. The mindset is the key, working out helps me stay positive, gets me through whatever it is I‚Äôm thinking in that moment. Work it out, work through itüí™üèæ If you‚Äôre thinking about it, just do it and don‚Äôt wait or delay it. Let‚Äôs goüôåüèæ #veganlife', 'post_hashtags': ['#veganlife'], 'likes': 476893, 'type': 'photo'}}, {'https://scontent-lhr8-2.cdninstagram.com/v/t51.2885-15/121698311_1667669373413776_604300737164754204_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-2.cdninstagram.com&_nc_cat=104&_nc_ohc=hqFbvqqeJY8AX-aLCMF&edm=APU89FABAAAA&ccb=7-4&oh=00_AT-a47sYYguXI4Qvhx7YrFnh_jDAC-mvj77sPQ_7VI2joQ&oe=626EC887&_nc_sid=86f79a': {'post_date': '2020-10-18T17:24:41.000Z', 'post_bio': 'Searching...', 'post_hashtags': [], 'likes': 537557, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/121585563_438813287082931_2492533744294490576_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=107&_nc_ohc=gjhQTBGmtqcAX9w5LaG&edm=APU89FABAAAA&ccb=7-4&oh=00_AT_6Ct-9mv8X8NcWIfsA3HJnTP3w12ENoQ_X8TVjtb1dyA&oe=626E62D5&_nc_sid=86f79a': {'post_date': '2020-10-17T16:55:27.000Z', 'post_bio': 'Weekend vibes with Roscoe', 'post_hashtags': [], 'likes': 630108, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/121485465_2554108681546623_1775484668771587286_n.jpg?stp=dst-jpg_e35&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=103&_nc_ohc=hUoYh-jbxhsAX8Ha3_q&edm=APU89FABAAAA&ccb=7-4&oh=00_AT8DBIDMJ4ab9xtErmcR-WBLaQDhp6P8WfE0GhA1Y1ZhLw&oe=626EA71E&_nc_sid=86f79a': {'post_date': '2020-10-15T16:32:52.000Z', 'post_bio': 'This is Roscoe, I‚Äôve had him for 8 years now. He loves to travel, he loves sticks, loves basketball and football. He ate normal dog food all of his life, as well as food with meat in it. His breathing has always been bad, which meant he was never able to walk very far and his joints would hurt. He also had skin allergies. 3 months ago, I decided to transition him to a vegan diet. It has changed his life. He now doesn‚Äôt have any breathing issues, his throat is no longer restricted, and he doesn‚Äôt overheat like he did before and he loves to run. He also has no allergy issues. He‚Äôs like a puppy again! It‚Äôs been amazing to see these changes in Roscoe and I‚Äôm so grateful to be able to share this. That said, I always recommend consulting with your vet before making any changes to your pet‚Äôs diet to ensure their nutritional needs are being met ‚Äì which is the most important thing.', 'post_hashtags': [], 'likes': 607973, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/123258727_377662176687082_2989295667499119908_n.jpg?stp=dst-jpg_e35&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=110&_nc_ohc=uSbp-igtyiMAX_YI4k6&edm=ALQROFkBAAAA&ccb=7-4&ig_cache_key=MjQzMTUyNTg4NTMzNzE4NDQwMQ%3D%3D.2-ccb7-4&oh=00_AT-_eN9awgeSLyV1tcKQirE2IYc8_nUOesb2co1MUO3K1w&oe=626E75CE&_nc_sid=30a2ef': {'post_date': '2020-10-30T17:54:55.000Z', 'post_bio': 'Rolling with my dawg', 'post_hashtags': [], 'likes': 568714, 'type': 'photo'}}, {'https://scontent-lhr8-2.cdninstagram.com/v/t51.2885-15/122822165_655388601831674_7038920739062541339_n.jpg?stp=dst-jpg_e35&_nc_ht=scontent-lhr8-2.cdninstagram.com&_nc_cat=102&_nc_ohc=Bf-ZXFlRQhoAX8-T2KM&edm=ALQROFkBAAAA&ccb=7-4&ig_cache_key=MjQzMDgxNDYyNDczNTY4Mjg5MA%3D%3D.2-ccb7-4&oh=00_AT9IDsty05zZdGfOl7g0gmahHNLDw5_ja3MNaNchB7or9Q&oe=626EED89&_nc_sid=30a2ef': {'post_date': '2020-10-29T18:21:46.000Z', 'post_bio': 'Just one of Roscoe‚Äôs many talents üéπüòÇ
