REPOST ... : @washingtonpost A new digital clock unveiled in Manhattan‚Äôs Union Square over the weekend promises to tell you exactly how long the world has left to act before an irreversible climate emergency alters human existence. The Climate Clock unveiled by artists Gan Golan and Andrew Boyd warned at 1:30 p.m. Monday that there were 7 years, 101 days, 17 hours, 29 minutes and 22 seconds until Earth‚Äôs carbon budget is depleted, based on current emission rates. A total depletion would thrust the world into further turmoil and suffering through more flooding, more wildfires, worsening famine and extensive human displacement, according to the artists. The timer counts down how long it will take for the world to burn through its carbon budget if swift action isn‚Äôt taken to keep warming under 1.5 degrees Celsius. If Earth‚Äôs temperatures increase by 1.5 degrees Celsius, the planet will fall victim to extreme heat waves, fires, droughts and limited water availability, a 2019 NASA report on global climate change warns. The clock‚Äôs second figure, displayed in green, is labeled a ‚Äúlifeline.‚Äù It tracks the percentage of available energy being supplied from renewable sources. Read more by clicking the link in our bio. (Photo by Ben Wolf)', 'post_hashtags': [], 'likes': 393922, 'type': 'photo'}}, {'https://scontent-man2-1.cdninstagram.com/v/t51.2885-15/119936825_178774170413462_8181950007885209368_n.jpg?stp=dst-jpg_e35&_nc_ht=scontent-man2-1.cdninstagram.com&_nc_cat=102&_nc_ohc=vmKN4LmbYKcAX9XZ9sS&tn=ZRY-MpqNu-mBjEbd&edm=ALQROFkBAAAA&ccb=7-4&ig_cache_key=MjQwMzk2NjE0MTM0MTAzNjczNA%3D%3D.2-ccb7-4&oh=00_AT-L5sidZXdIhr_BQybquJTzKMlIERt7k_DLrESCGH3YHA&oe=626FD282&_nc_sid=30a2ef': {'post_date': '2020-09-22T17:18:37.000Z', 'post_bio': 'Over the last five seasons, I have loved working with @tommyhilfiger to push boundaries, take creative risks and capture my personal sense of style in our designs. Our new #TommyXLewis collection embodies everything we stand for ‚Äì fro