üì∏: @motorsport.images', 'post_hashtags': ['#wewinandwelosetogether'], 'likes': 793070, 'type': 'photo'}}, {'https://scontent-man2-1.cdninstagram.com/v/t51.2885-15/118691890_943746522794761_8413593599952917324_n.jpg?stp=dst-jpg_e35_s1080x1080&_nc_ht=scontent-man2-1.cdninstagram.com&_nc_cat=101&_nc_ohc=ZVlungjPpCQAX_K0o3f&edm=APU89FABAAAA&ccb=7-4&oh=00_AT8BJcDWWImBzTVe-5kvpNtvp5rfFlc0JfnJ-LZEnkLIpA&oe=626F4028&_nc_sid=86f79a': {'post_date': '2020-09-03T14:14:56.000Z', 'post_bio': 'Recently I‚Äôve been making many changes in my life to reduce my impact on the environment. The first step in this journey was to understand my personal impact on the planet so I could make changes to improve it. Since then, I have offset my carbon footprint from my Formula 1 career dating back to 2007, I have reduced travel where possible, I have gone plant-based and outside of the track, I try to use electric cars wherever possible. I also want to use my position as a racing driver to enforce positive and permanent change, which is why I‚Äôm working closely with Mercedes to slowly move their fleet of cars towards electric. This is my new dream car, the new EQS fully electric Mercedes. I can‚Äôt wait until it‚Äôs released!

It‚Äôs difficult to always be perfect when we go about our daily lives, but I‚Äôm continuing to learn how to be better and I‚Äôm committed to staying educated and informed so I can play my part. Small steps lead to big change, so it‚Äôs important we all take a moment to understand our footprint and the small changes we can make in our everyday lives to put our planet first. The last step for me will be when I step away from this sport and can focus fully on helping heal the world to provide a better future for our kids and our kids, kids. #VisionEQS @mercedesbenz', 'post_hashtags': ['#VisionEQS'], 'likes': 1065808, 'type': 'photo'}}, {'https://scontent-man2-1.cdninstagram.com/v/t51.2885-15/118644784_328810898175434_223242925428136739_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-man2-1.cdninstagram.com&_nc_cat=102&_nc_ohc=Y6vEqzbeYvMAX-7njwu&edm=APU89FABAAAA&ccb=7-4&oh=00_AT_hNYQQcb7RyO3Fw_aqO8-EWo3vQPF6VmYQgTl2YvEJ_w&oe=626E933F&_nc_sid=86f79a': {'post_date': '2020-09-02T18:20:31.000Z', 'post_bio': 'There are two sides to me. First, the one you see on TV. The competitive, cut throat, hungry racer in me that comes out when I close the visor. When the visor is down I come alive, all my fears, insecurities, and doubts are cast aside and my focus kicks in and will not break until the job is done. It feels like I get to have the superpowers I always dreamed of having, but behind the wheel.

Second, theres just me. Someone who is figuring life out day by day, just like you. Trying to find inner peace, manage time, balance work and life, finding time for family and friends, working on managing my emotions, and trying to find time for the other things I am passionate about. Like many of you, I‚Äôm just trying to be and do my best in everything.

I also have a lot of difficult days. Especially in the bubble that we‚Äôre currently in. You get lonely, you miss your friends and family, and with back to back race weeks it means there‚Äôs not much time for anything but work. So I‚Äôm grateful for the ones closest to me for helping me to keep a balance, even if it‚Äôs just thru text, phone or FaceTime.

I guess what I‚Äôm trying to say is, It‚Äôs never a bad thing to ask for help if you need it, or to tell somebody how you feel. Showing your vulnerable side doesn‚Äôt make you weak, instead, I like to think of it as a chance to become stronger, and better than we were. Where ever you are in the world, I hope and pray you know you are incredible, gifted, talented, beautiful and strong, and no matter what anybody says, you can do almost anything you put your mind to. All you have to do is believe and do the work. Loveüôèüèæ', 'post_hashtags': [], 'likes': 546009, 'type': 'photo'}}, {'https://scontent-man2-1.cdninstagram.com/v/t51.2885-15/118638569_317094226180481_5429820854363652680_n.jpg?stp=dst-jpg_e35_p1080x1080&_nc_ht=scontent-man2-1.cdninstagram.com&_nc_cat=105&_nc_ohc=LWtYkS0iHLUAX9663Fa&tn=ZRY-MpqNu-mBjEbd&edm=APU89FABAAAA&ccb=7-4&oh=00_AT8U73gMPKx8hYZ-jhwmckxSuKZEX4UVqcLLnZXk8YSGCQ&oe=626ED9E5&_nc_sid=86f79a': {'post_date': '2020-08-30T16:54:11.000Z', 'post_bio': 'It‚Äôs been an emotional weekend, I want to dedicate this win to Chad and his family, he was such an inspiration and his legacy will live on. I‚Äôm posting this image because we must continue to fight for equality, nothing has changed yet and the battle continues. Racism is still very much alive, it seems it‚Äôs even more overt than it has been for a long time. The fight MLK and others alike were fighting, is still very much relevant today and we have to work together to make sure that our kids have a better future. #BlackLivesMatter', 'post_hashtags': ['#BlackLivesMatter'], 'likes': 911627, 'type': 'photo'}}, {'https://scontent-man2-1.cdninstagram.com/v/t51.2885-15/118482012_363359681723040_2802485245291046488_n.jpg?stp=c0.186.480.480a_dst-jpg_e35&_nc_ht=scontent-man2-1.cdninstagram.com&_nc_cat=100&_nc_ohc=G3fzdCOGQ0IAX8eIxo1&tn=ZRY-MpqNu-mBjEbd&edm=APU89FABAAAA&ccb=7-4&oh=00_AT9ocRnSGnQqBr6ngguxkzyzUIReiRxg3B2cGrhO9cXagA&oe=626A2968&_nc_sid=86f79a': {'post_date': '2020-08-30T10:10:31.000Z', 'post