üì∏: @motorsport.images', 'post_hashtags': ['#StillWeRise'], 'likes': 701271, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/117965239_226234138702299_2339597546456392766_n.jpg?stp=dst-jpg_e35_p1080x1080&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=103&_nc_ohc=zx6BS0sXs3wAX-nxcTe&edm=APU89FABAAAA&ccb=7-4&oh=00_AT9_GHE4ep-oobly1LimE1JADcDX5CiO35fF7Dq6NbSeaw&oe=626FBE94&_nc_sid=86f79a': {'post_date': '2020-08-16T11:57:52.000Z', 'post_bio': 'The state of environmental emergency declared in Mauritius is truly heartbreaking. Their beautiful coral reefs are home to thousands of different species of marine life, and to see their natural habitat under threat should spur us all into action. I‚Äôve been amazed by the determined volunteers in Mahebourg, who are working to control the oil spill as best they can and I encourage more governments to join France in the international effort to support the clean-up operation. It‚Äôs essential we work together to correct the damaging effects of the spill, as climate change is already taking its toll on our planet and we simply cannot afford for these ecological disasters to continue. While the need for the ocean clean-up is immediate, I will be looking for ongoing ways I can support those in Mauritius to recover from this disaster and will post to my stories for those looking to help. Stay strong Mauritius.', 'post_hashtags': [], 'likes': 374598, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/117708467_306755930565573_2873254170500229778_n.jpg?stp=c0.186.480.480a_dst-jpg_e35&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=109&_nc_ohc=KiNeMiXd7B0AX-BLgdV&edm=APU89FABAAAA&ccb=7-4&oh=00_AT8xHrLcCFr6TdE5jQFoZZBnIoslo5pg7gXvHfLWYhqmrQ&oe=626AA9CA&_nc_sid=86f79a': {'post_date': '2020-08-15T19:45:37.000Z', 'post_bio': '92nd Pole!

