@f1 @mercedesamgf1 #SpanishGP', 'post_hashtags': ['#SpanishGP'], 'likes': 1359166, 'type': 'video/mp4'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/117815133_313332240025176_4395993832232051785_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=100&_nc_ohc=hBmvLmxnyDcAX-c_wVu&edm=APU89FABAAAA&ccb=7-4&oh=00_AT_BMesOEkYIvZ9X-H4yjT0M3PQcQJsHsrhDeeBGg3ClKg&oe=626AAE16&_nc_sid=86f79a': {'post_date': '2020-08-14T18:34:04.000Z', 'post_bio': 'Finding ways to keep training exciting and fun. Like many of you I‚Äôm sure, the gym can be boring and after a while we can lose the desire to keep pushing. At least that‚Äôs how I feel, so I try to do different sports. If you‚Äôre like me, try as many sports as you can to find things you like. Training with a friend helps too, I‚Äôm lucky that @cullen_angela is down for trying them all. I loved this day being on my bike even tho my backside was killing me after but no pain no gain. Sending you all positive energy for your weekendüí™üèæüëäüèæ stay safeüôèüèæ #nopainnogain', 'post_hashtags': ['#nopainnogain'], 'likes': 1305449, 'type': 'video/mp4'}}, {'https://scontent-lhr8-2.cdninstagram.com/v/t51.2885-15/117605747_948782455545365_6048698545514541092_n.jpg?stp=dst-jpg_e35_s1080x1080&_nc_ht=scontent-lhr8-2.cdninstagram.com&_nc_cat=105&_nc_ohc=kBosl98yt4cAX_rKWXw&edm=APU89FABAAAA&ccb=7-4&oh=00_AT-9f3CIGttrWEw8B6hJXV_wyySynbtC7TlBE3tfsnfPIg&oe=626F17A9&_nc_sid=86f79a': {'post_date': '2020-08-13T15:31:48.000Z', 'post_bio': 'Took the day off on Tuesday, a day for myself and no phone, no training, just me and Roscoe on the water. I had time to reflect on where we are in the world today, everyday I see something upsetting happening, people being abused, people suffering, volcanos erupting, explosions, oceans and forest‚Äôs being destroyed. 2020 is such a heavy year. But it gives me hope seeing people come together, fighting for justice, people cleaning up oceans and just generally doing more for our planet and the people in it. I‚Äôm sending you all positive waves, keep pushing and inspiring those around you. üôèüèæ', 'post_hashtags': [], 'likes': 522525, 'type': 'video/mp4'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/117289322_293838935044307_4634010186575938904_n.jpg?stp=dst-jpg_e35_p1080x1080&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=111&_nc_ohc=HUZxqp3xlDcAX8ujZnb&tn=ZRY-MpqNu-mBjEbd&edm=APU89FABAAAA&ccb=7-4&oh=00_AT8D6Oni3C4QazVFB9huI16I3FWBv2_bj5QubiWo0tUelw&oe=626EF60E&_nc_sid=86f79a': {'post_date': '2020-08-10T17:18:36.000Z', 'post_bio': '#justiceforbreonnataylor', 'post_hashtags': ['#justiceforbreonnataylor'], 'likes': 620207, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/117256202_779737842831201_7532399870459266162_n.jpg?stp=dst-jpg_e35_p1080x1080&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=109&_nc_ohc=buk2XnVKOKcAX8hFeks&edm=APU89FABAAAA&ccb=7-4&oh=00_AT8WAURr-watspVbke3jXnX6-07EsdsOTcMLkl3kKrq76g&oe=626F6CA6&_nc_sid=86f79a': {'post_date': '2020-08-09T16:10:18.000Z', 'post_bio': 'Now whilst we didn‚Äôt get the result we‚Äôd hoped for, that was such a challenge out there. I actually really enjoyed the struggle. To come back at the end was fun, not enough to stop Max who did a great job today but enough to get good points. Lots to learn from today but I continue to be grateful to this team for fighting hard no matter what and allowing us to fight it out there on track.
