he Vision EQS. #VisionEQS', 'post_hashtags': ['#VisionEQS'], 'likes': 741627, 'type': 'video/mp4'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/113585369_780969962709824_6118507209980416108_n.jpg?stp=dst-jpg_e35&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=108&_nc_ohc=R2wMQteMFyEAX-60pas&edm=APU89FABAAAA&ccb=7-4&oh=00_AT-yQOX0Ie06jCs9NLH4w2dw8eCdNMmPNWdX8lsac7aiOA&oe=626F0E78&_nc_sid=86f79a': {'post_date': '2020-07-24T16:31:15.000Z', 'post_bio': 'I had the incredible opportunity to hang out with @hanszimmer earlier this year. Chances are, he‚Äôs scored some of your favourite movies. Getting to see his studio was amazing and get an insight into how he does what he does. It was such an honour and I‚Äôm forever grateful for the time he gave me. Such an inspiring individual üôåüèæ
