 effort, which in turn dilutes the message and makes it seem like there was something more important. It doesn‚Äôt matter if you stand or kneel, but we should be showing the world that F1 is united in its commitment to equality and inclusivity. F1 and the FIA need to do more. There is no quick fix for racial inequality, but it is certainly something that we can‚Äôt just acknowledge once and then move on. We have to stay focussed, keep highlighting the problem and hold those with the power accountable.
#BlackLivesMatter #EndRacism', 'post_hashtags': ['#BlackLivesMatter', '#EndRacism'], 'likes': 772581, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/109068013_178034950381615_5667142508563017566_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=107&_nc_ohc=x2rbwaL1rmIAX_z_bj4&edm=APU89FABAAAA&ccb=7-4&oh=00_AT8KMKxhAQPqz1eMp-56g_g9esITKNAHgxoBIgunMgKWCg&oe=626FB573&_nc_sid=86f79a': {'post_date': '2020-07-19T12:35:18.000Z', 'post_bio': 'The time is now to fight for whatever you feel is right, change is coming! It will take us working together and I dream of our future, where our kids don‚Äôt have to feel what it‚Äôs like to be discriminated against. Thank you to those of you for learning and opening your heart to change. Today I‚Äôm racing for you guys because we win and we lose together. #stillwerise', 'post_hashtags': ['#stillwerise'], 'likes': 640648, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/110007774_749732342429087_1594529227525928116_n.jpg?stp=dst-jpg_e35_s1080x1080&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=111&_nc_ohc=T2X2xuuqtmcAX-gAEKm&tn=ZRY-MpqNu-mBjEbd&edm=APU89FABAAAA&ccb=7-4&oh=00_AT_LuH-C72Uu_NZzyOWktVXEX1KMIr6e1mA_fUw8nLc9Ew&oe=626FA918&_nc_sid=86f79a': {'post_date': '2020-07-18T14:25:53.000Z', 'post_bio': 'My 90th pole position! And my 7th pole position in Hungary ü§òüèæüî• Those qualifying laps felt great. I‚Äôm focused as ever for tomorrow. Still feels strange not having you guys there cheering us on but I hope you‚Äôre all staying safe. Sending you all positive vibes üôèüèæ #HungarianGP #TeamLH
