#TeamLH', 'post_hashtags': ['#TeamLH'], 'likes': 558364, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/109082637_1662901747192951_5304077950993583881_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=107&_nc_ohc=9hVXZXd0PksAX_vffum&edm=APU89FABAAAA&ccb=7-4&oh=00_AT85UgfVu9r0IHIm2ryvbo99aHJkghTWSqn_R27v5abl5g&oe=626A50C4&_nc_sid=86f79a': {'post_date': '2020-07-15T19:10:10.000Z', 'post_bio': 'I‚Äôve been training most of my life. The physical and mental pressures of my job are intense. Training has been the most challenging in the past few years since I train myself. I have ups and downs, I lose momentum and slack every now and then but more often than not I get it done. The battles between cardio and muscle gain are always a struggle, cardio is needed to keep up with the high pace cars, fast reactions and efficiency and muscle you need strength but not of a weightlifter. I was 68kg(150lb) for 12 years as a job requirement but with rule changes I‚Äôve been allowed to put on weight and yes with being vegan I‚Äôve put on muscle. It‚Äôs hard to see when it takes so long to see gains that by the time you have gains your so used to the way you look it‚Äôs the norm. But staying fit is a lifestyle, a life choice. Even if you feel you might not have the time, when you roll out of bed do press ups and sit ups before you shower as every little bit helps. And most importantly, eat right as that‚Äôs 70% of it so they say. You can do it, I believe in you if getting fit is what you wantüí™üèæ #workout #youcandoit #stayfit #stayhealthy', 'post_hashtags': ['#workout', '#youcandoit', '#stayfit', '#stayhealthy'], 'likes': 3477072, 'type': 'video/mp4'}}, {'https://scontent-lhr8-2.cdninstagram.com/v/t51.2885-15/107831140_3120284068061716_6584804796648127372_n.jpg?stp=dst-jpg_e35_s1080x1080&_nc_ht=scontent-lhr8-2.cdninstagram.com&_nc_cat=104&_nc_ohc=MVwbYG_16I0AX8I06my&edm=APU89FABAAAA&ccb=7-4&oh=00_AT9w2d__8ZyTVbSAlUakpXV69jZ4W_LscKWI9KPrqZfNLQ&oe=626E4FDB&_nc_sid=86f79a': {'post_date': '2020-07-13T19:57:54.000Z', 'post_bio': 'I wanted to post this because it‚Äôs such an important moment. This is Stephanie who is one of my teammates. She is one of our trackside fluid engineers. On Sunday, she became the first black woman to stand on the podium in Formula 1 history. This is an amazing achievement and I just wanted to acknowledge her for her hard work, positivity, and passion for her job.
Like most of the jobs in our sport they are in high demand, and Stephanie was selected out of over 7000 applicants for her role. Steph said she wants to inspire young black children, and children of colour to believe that they can do it too, and I couldn‚Äôt agree more. Put your mind to it, and you can be anything you want to be. So whilst I really appreciate all of the congratulations, I wanted take the opportunity to lift her up, and share them with her. #manifest #hardwork #bethechange', 'post_hashtags': ['#manifest', '#hardwork', '#bethechange'], 'likes': 684651, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/107156981_770697407034645_2475183110795344441_n.jpg?stp=c0.179.1440.1440a_dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=109&_nc_ohc=-s3FmhACJqIAX_dioa7&edm=APU89FABAAAA&ccb=7-4&oh=00_AT9mSOCN7Qlbpb1DCTAP_jWywv9CtTbIA9toCj8cvqm3TA&oe=626F85FC&_nc_sid=86f79a': {'post_date': '2020-07-12T17:31:03.000Z', 'post_bio': 'We stand together and fight‚úäüèæ the team today took the knee which was just amazing to see that together we can learn, be open minded and conscious of what‚Äôs going on in the world. Today we won but we have a long way to go. Thank you so much to everyone in my team, here at the track and back at the factory. I hope you are proud of what we are standing for and achieving together. A huge thanks to all of you #TeamLH, I appreciate all of your support and your positive messages, you‚Äôve really kept me going üôèüèæ
