Link in bio to watch the full video.', 'post_hashtags': [], 'likes': 434015, 'type': 'video/mp4'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/105943778_2573993526200134_1875267372975898997_n.jpg?stp=c0.169.1349.1349a_dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=110&_nc_ohc=IYgwv09UaKEAX-1td0G&edm=APU89FABAAAA&ccb=7-4&oh=00_AT8P0_nWDUM6F3IzEjdzL5q8vxcZV53H40GUf_5AKaJn9Q&oe=626F6322&_nc_sid=86f79a': {'post_date': '2020-06-29T16:54:25.000Z', 'post_bio': 'I am so proud of this team, for being open eyed to the serious issue of racism and discrimination. They‚Äôve taken steps to ensure they are being open minded, to be willing to learn from lessons past and present and working together whole heartedly for a better, more equal and inclusive future. The silver arrows has been a prominent leader for decades and this marks a new era for them also where we push for inclusion and diversity. We have much to do but I‚Äôm confident that together we can help change this sport and spark the others in the industry to follow.
