positive that change will come, but we cannot stop now. Keep pushing. #blacklivesmatter ‚úäüèæ üì∏ @spinzbeatsinc', 'post_hashtags': ['#blacklivesmatter'], 'likes': 574215, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/103927373_1703670919811658_6563564473569471702_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=106&_nc_ohc=O5qmdEdk7RcAX8FTnS3&edm=APU89FABAAAA&ccb=7-4&oh=00_AT_7ObyibyfTtY8sQztO33b4GsAREmR7RDcYqhlkAIfAYw&oe=626A8AE3&_nc_sid=86f79a': {'post_date': '2020-06-19T17:41:39.000Z', 'post_bio': 'She was the best...#coconut #myheart #restinpeace', 'post_hashtags': ['#coconut', '#myheart', '#restinpeace'], 'likes': 1333100, 'type': 'video/mp4'}}, {'https://scontent-lhr8-2.cdninstagram.com/v/t51.2885-15/103957006_265381697862961_3019878565148035931_n.jpg?stp=dst-jpg_e35_s1080x1080&_nc_ht=scontent-lhr8-2.cdninstagram.com&_nc_cat=101&_nc_ohc=ZMt6RkK4g7MAX-6ZcqZ&edm=APU89FABAAAA&ccb=7-4&oh=00_AT8GdtZQcMjszgpusoBAyWsCu8JGQc6wD45N1ILB0OcMPw&oe=626E4BBD&_nc_sid=86f79a': {'post_date': '2020-06-19T12:22:54.000Z', 'post_bio': 'Last night at around 9pm, my beautiful little girl Coco died at home with the family by her side. Her little heart gave in, we think it was a heart attack. I tried to revive her but it was no use. She‚Äôd had the best day, happier than I‚Äôd seen her in a long time. She was such a special dog, born with so many problems and I feel so lucky to have adopted her. Her breeder said she was going to have to put her down as she wouldn‚Äôt be able to afford all the things she would need to survive, she went through a lot to become the bouncy, lazy loving dog she was. On her last day, we shared a special moment playing together which I will never forget. I will miss her snoring and how happy she was always to see me. She was only 6, healthy and happy. Naturally, my heart is broken but i hope she‚Äôs in a better place with my Aunty Diane. Wanted to share with you and thank those of you who loved and cared for her. #coco #restinpeace', 'post_hashtags': ['#coco', '#restinpeace'], 'likes': 672078, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/104289115_2587806694802985_8039188216661347770_n.jpg?stp=c0.172.1378.1378a_dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=109&_nc_ohc=u1rhQSFPZxkAX97WUt3&edm=APU89FABAAAA&ccb=7-4&oh=00_AT99ccBMwXIoXHuZyR_Lm0TkYae3ueqrtOryZddBzW-2vA&oe=626F3274&_nc_sid=86f79a': {'post_date': '2020-06-18T17:05:45.000Z', 'post_bio': 'With all that is happening in the world, my only get away is to train and channel the emotions and energy into building my body stronger. This has been the best training period I‚Äôve ever had, I can‚Äôt stop and I won‚Äôt! Staying active both mentally and physically is so important today, I want to encourage those of you out there to keep working out even if it‚Äôs only for 20 minutes. Every little helps.', 'post_hashtags': [], 'likes': 740987, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/104198332_270379960976118_3743231066731182900_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=106&_nc_ohc=EpcmUnxirtwAX992q5n&tn=ZRY-MpqNu-mBjEbd&edm=APU89FABAAAA&ccb=7-4&oh=00_AT_Uu9uDpM4blL_5eT_VkDYAAOt-gYQ8qvBHINfbD7WGlA&oe=626FBA22&_nc_sid=86f79a': {'post_date': '2020-06-17T19:08:46.000Z', 'post_bio': 'This was me learning to defend myself. As a smaller kid, I wanted to be able to stay safe but also be able to defend those who didn‚Äôt feel they could fight for themselves. Helping out a kid from being bullied was probably the only highlight of my school life but one I‚Äôm grateful for. The discipline you learn with martial arts, you can apply to everyday life and has helped me in chasing my dreams with confidence.', 'post_hashtags': [], 'likes': 284602, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/104135836_272564717343463_7679456310173284297_n.jpg?stp=c0.186.480.480a_dst-jpg_e35&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=107&_nc_ohc=zjMERqM7wYcAX_4Ej4Y&edm=APU89FABAAAA&ccb=7-4&oh=00_AT9uPP44FvM6mq4tnUaAYzcgKhhMXY_o7dcfdFbR27D5VQ&oe=626A9735&_nc_sid=86f79a': {'post_date': '2020-06-17T16:27:02.000Z', 'post_bio': 'I love Ali

He‚Äôs been one of my biggest inspirations my whole life. A man that knew just what to say. As a black kid growing up in a predominantly white city, and country (over 80% white in the UK), it‚Äôs hard to be the only one in your class, or job. Like all of us, no matter what colour you are, it‚Äôs great to have people to look up to. Ali was one of those for me, as well as my Dad. I was one of perhaps 6 or 7 black kids in a school of over 1000. At least 5 of those black kids sat outside the head masters office most of the time as our headmaster deprived us of our confidence and education. This message really touched me as I would go to church and think the same. Ali also gave me the confidence that our headmaster did not. He helped me to believe that someone that looked like me could do anything, and that my dreams were achievable, and that‚Äôs what I hope to do for the generations after me, and to remove limitations based on race.', 'post_hashtags': [], 'likes': 975225, 'type': 'video/mp4'}}, {'https://scontent-lhr8-2.cdninstagram.com/v/t51.2885-15/103951311_1106089339774214_8697201945661940329_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-2.cdninstagram.com&_nc_cat=102&_nc_ohc=i2JfLHiAxY8AX9HcIDp&edm=APU89FABAAAA&ccb=7-4&oh=00_AT8c-P5LCgb5e2aIP2sMDfdsClZ6zLn7Tv39ngc-hk5HlA&oe=626A3485&_nc_sid=86f79a': {'post_date': '2020-06-16T14:01:31.000Z', 'post_bio': 'Everyone, no matter where they‚Äôre from or the colour of their skin, should have access to a quality education. As Nelson Mandela once said, ‚ÄúEducation is the most powerful weapon which you can use to change the world.‚Äù Shockingly, there are still millions of children globally who don‚Äôt have access to schools and education. This needs to change, which is why I‚Äôm honoured to announce that I‚Äôve teamed up with @togetherbandofficial to be the ambassador for Global Goal 4: Quality Education.
To help spread this important message, I recently visited @alpertoncs to talk to its incredible students about the importance of education, as well as my experiences at school and what it was like growing up with dyslexia.
Join me in helping to spread awareness for quality education by wearing this #TOGETHERBAND. I‚Äôm sharing my second band with my good friend, @serenawilliams, who cares deeply about children, and their right to a good education.
#TOGETHERBAND #BOTTLETOP #GLOBALGOALS #GOAL4 #UNFOUNDATION #UBS', 'post_hashtags': ['#TOGETHERBAND', '#TOGETHERBAND', '#BOTTLETOP', '#GLOBALGOALS', '#GOAL4', '#UNFOUNDATION', '#UBS'], 'likes': 695508, 'type': 'video/mp4'}}, {'https://scontent-lhr8-2.cdninstagram.com/v/t51.2885-15/103393175_284654612912006_5496972462890644271_n.jpg?stp=dst-jpg_e35_p1080x1080&_nc_ht=scontent-lhr8-2.cdninstagram.com&_nc_cat=102&_nc_ohc=1cKCSYvhns0AX9HY22w&edm=APU89FABAAAA&ccb=7-4&oh=00_AT-xvO-dNcpNdiuMH-NwMT2s3i6iwydH3a8ty7thGXn0ig&oe=626ECE15&_nc_sid=86f79a': {'post_date': '2020-06-14T12:49:32.000Z', 'post_bio': 'Today marks three years since the horrific Grenfell Tower fire in London. Remembering the 72 souls we lost and their loved ones, and everyone affected by this tragedy. #justiceforgrenfell üôèüèæ‚úäüèæüíöüíöüíö üì∏: @henricalderon', 'post_hashtags': ['#justiceforgrenfell'], 'likes': 133945, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/104215917_297571254744574_275925259760141335_n.jpg?stp=dst-jpg_e35_s1080x1080&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=110&_nc_ohc=5fKf2q0Nzw4AX_AAeyH&edm=APU89FABAAAA&ccb=7-4&oh=00_AT8fJXNPLFuWtZUbokZuS08MrC00-Rxg4ZL9QbTy3WaWgg&oe=626F008B&_nc_sid=86f79a': {'post_date': '2020-06-11T17:00:40.000Z', 'post_bio': 'This past week, I have felt so inspired by the thousands of people across the globe using their voices to speak out against racial injustice. Fighting for real change starts with us, whether peacefully protesting, showing support on social media or signing petitions.
However, our fight for equality must continue beyond this. Racism is a global disease and one which we must tackle with our votes as well as our voices. Please do your research and ensure the politicians you vote into power have everyone‚Äôs best interests at heart. The prejudice against black people at a systemic level has got to stop.
For those looking for ways to support, I have provided information on petitions you can sign, as well as some books and films to learn more about the black experience. For the next generation, this education into black history should be starting at school. The global curriculum needs to be updated to include the struggles and successes of black people throughout the centuries, otherwise history is destined to repeat itself.
As we have seen with the arrest and elevated charges for the officers who killed George Floyd, there is power in our voices, we can bring about change, and we must continue to fight for racial equality. For those of you who are out there fighting, know that I see you and I am right by your side.
#blacklivesmatter', 'post_hashtags': ['#blacklivesmatter'], 'likes': 173637, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/103382543_915700315597824_4917155948554315241_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=100&_nc_ohc=P6hn_pp-va8AX_8YMA1&edm=APU89FABAAAA&ccb=7-4&oh=00_AT_ONoUMFRNx_oKVcAdJrBzPX0ajerw6bgypr4m43kCDTw&oe=626E9717&_nc_sid=86f79a': {'post_date': '2020-06-11T15:59:12.000Z', 'post_bio': 'Congo, 1955 (Belgian colony at the time) this was only 65 years ago.', 'post_hashtags': [], 'likes': 493539, 'type': 'photo'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/103627065_289458649094362_8920574623876466169_n.jpg?stp=dst-jpg_e35_p1080x1080&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=110&_nc_ohc=GzMjlvVAxBsAX8X_P2u&edm=APU89FABAAAA&ccb=7-4&oh=00_AT_kZWSE2DOKevNe-prWWCeCNkkM9k9VunsmjQTkav80nw&oe=626F8F79&_nc_sid=86f79a': {'post_date': '2020-06-09T20:12:11.000Z', 'post_bio': "These past few weeks, we've seen the world open its eyes to the realities of racism today. People all over the world have united, and are using their voices and platforms in the fight for racial equality, and against police brutality and white supremacy.
While we still have a long way to go in addressing this issue, I want to take a moment to appreciate the positive steps that have been taken so far, as a result of our collective voices and actions.
We've seen laws being passed. We‚Äôve seen police officers held accountable and charged for their fatal actions. Brands have started to align themselves with the Black Lives Matter movement, and are educating themselves on how they can do better. There's also been a surge in the sale of anti-racist books, and many are watching films and documentaries to better educate themselves on our experience.
