I support this', 'post_hashtags': ['#Repost'], 'likes': 3217543, 'type': 'video/mp4'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/103052751_169172101242236_337295899180910697_n.jpg?stp=dst-jpg_e35&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=108&_nc_ohc=bR1OvOhOFd8AX-102Q-&edm=APU89FABAAAA&ccb=7-4&oh=00_AT_WneV7TdEoTlR_yp7wxLgKT_y-5Q_zJjBRKwo5K6sXvQ&oe=626A8F04&_nc_sid=86f79a': {'post_date': '2020-06-05T21:18:33.000Z', 'post_bio': 'I‚Äôve been reading every day to try to stay on top of everything that‚Äôs been happening in our fight against racism, and it‚Äôs brought back so many painful memories from my childhood. Vivid memories of the challenges I faced when I was a kid, as I‚Äôm sure many of you who have experienced racism or some sort of discrimination have faced. I have spoken so little about my personal experiences because I was taught to keep it in, don‚Äôt show weakness, kill them with love and beat them on the track. But when it was away from the track, I was bullied, beaten and the only way I could fight this was to learn to defend myself, so I went to karate. The negative psychological effects cannot be measured.
This is why I drive the way I do, it is far deeper than just doing a sport, I‚Äôm still fighting. Thank God I had my father, a strong black figure who I could look up to, that I knew understood and would stand by my side no matter what. Not all of us have that but we need to stand together with those who may not have that hero to lean on and protect them. We must unite! I have wondered why 2020 seemed so doomed from the start but I‚Äôm starting to believe that 2020 may just be the most important year of our lives, where we can finally start to change the systemic and social oppression of minorities. We just want to live, have the same chances at education, at life and not have to fear walking down the street, or going to school, or walking into a store whatever it may be. We deserve this as much as anyone. Equality is paramount to our future, we cannot stop fighting this fight‚úäüèæ, I for one, will never give up! #blacklivesmatter #endracism #nevergiveup #wewinandwelosetogether', 'post_hashtags': ['#blacklivesmatter', '#endracism', '#nevergiveup', '#wewinandwelosetogether'], 'likes': 1712982, 'type': 'video/mp4'}}, {'https://scontent-lhr8-1.cdninstagram.com/v/t51.2885-15/102687548_267309577805923_2849496795440383650_n.jpg?stp=dst-jpg_e35&_nc_ht=scontent-lhr8-1.cdninstagram.com&_nc_cat=107&_nc_ohc=szhps_5pt9wAX_fSogO&edm=ALQROFkBAAAA&ccb=7-4&ig_cache_key=MjMyNzgzMDQ2MzU1NDg1MDU4OQ%3D%3D.2-ccb7-4&oh=00_AT8Z7zNLnYcBoycrMnkgL45w9gTT1ZpQdVhrza7LpD93tg&oe=626E91EC&_nc_sid=30a2ef': {'post_date': '2020-06-09T16:10:37.000Z', 'post_bio': 'This photo was taken in 1992 at a KKK rally. This child was born with love in its heart but taught to hate. This is sickening. This shouldn‚Äôt happen but is happening around the world, parents passing on their hate, their fears and beliefs. We have to change how people are educated, change how we educate our children so they don‚Äôt learn hate, they continue to be the loving kindred spirits they are born as. #wehavetodobetter #love #chang